(22, 24, 1, 6, 5, 'Aqaar', 'عقار', 'MD', 'MANGER', NULL, 'عقار هي مؤسسة حكومية عامة ، تأسست عام 2016 بموجب مرسوم أميري رقم (9) \r\nمن رؤية صاحب السمو الشيخ حميد بن راشد النعيمي عضو المجلس الأعلى حاكم عجمان.', 'Aqaar is a Government Public Corporation, founded in 2016 by an Emiri Decree No. (9)\r\n from the vision of His Highness Sheikh Humaid bin Rashid Al Nuami Supreme Council Member and Ruler of Ajman.', 'AQAAR - Ajman Properties Corporation - شارع الشيخ خليفة بن زايد - عجمان - الإمارات العربية المتحدة', '25.3924655', '55.4389495', 2206, 0, 1, 0, NULL, '2023-04-23 18:26:02', '2024-09-14 14:05:55'),
