(24, 26, 1, 7, 1, 'Trevi Design', 'Trevi Design', 'MD', 'MANGER', NULL, 'إن شركة التصميم الداخلي والتجهيز لدينا مكرسة لتقديم \r\nحلول مخصصة ومخصصة لجميع احتياجاتك الداخلية.', 'Our interior design and fitout company is dedicated to delivering personalized\r\n and customized solutions for all your interior needs', 'Trevi WARDE Abu Dhabi interior design company, Park - شارع الخَلِيج العَرَبي - opposite Khalidiyah - أبو ظبي - الإمارات العربية المتحدة', '24.4705727', '54.3439154', 5240, 0, 1, 1, NULL, '2023-04-23 19:05:14', '2024-09-14 14:05:27'),
(25, 27, 1, 7, 1, 'Modern Emirates Furniture', 'مفروشات الامارات الحديثة', 'MD', 'MANGER', NULL, 'منذ أكثر من عقد من الزمان في سوق الإمارات العربية المتحدة للأثاث الحديث \r\nمتخصصون في توريد الأثاث المكتبي في الإمارات العربية المتحدة', 'Modern Emirates Furniture has been more than a decade in the United Arab Emirates\r\n market, specializing in office furniture suppliers in UAE', 'Modern Emirates Furniture & Office Equipment L.LC - دبي - الإمارات العربية المتحدة', '25.2682524', '55.33980829999999', 4538, 0, 1, 0, NULL, '2023-04-23 19:14:14', '2024-09-14 14:05:58'),
