(80, 102, 1, 1, 1, 'Al Gafry Consulting Architects Engineers', 'الغافرى للإستشارات الهندسية', 'MOHAMED', NULL, NULL, 'الغافرى للإستشارات الهندسية', 'Al Gafry Architecture Engineering Consultancy was founded in 2006 by a team of talented architects, engineers, designers, construction inspectors and support personnel, whose goal is to consistently provide high quality services and meet client schedule objectives. As Engineers, we make our design ideas tangible in distinctive place and create sophisticated design with clear value. Efficient concept planning is the backbone of our firm to transform an imagination into a reachable reality.', '79HP+8G Dubai - United Arab Emirates', '25.2783125', '55.3863125', 3014, 0, 1, 0, NULL, '2023-06-12 12:57:59', '2024-09-14 14:05:33'),
