(83, 105, 1, 1, 2, 'Altorath International Engineering Consultants', 'التراث انترناشونال للاستشارات الهندسية', 'MOHAMED', NULL, NULL, 'التراث انترناشومال للإستشارات الهندسية', 'Since the formation in 1989 Altorath International Engineering Consultants L.L.C have become one of the largest and most respected providers of architectural, engineering design and project management services in the GCC region.\r\nOver the years we have approximately +700 employees in 7 offices across the Middle East. We are a recognized industry leader in our specialist fields and pride ourselves in being a 100% UAE National company.\r\nIn pursuit of excellence AIC delivers a fully integrated range of professional services that combine to make a real difference to our clients and the communities in which we work.\r\nAIC is organised to encourage the creative process, to cross-pollinate ideas and talents across offices and deliver quality at all levels, in all places. Our passionate pursuit of excellence, the application of our creativity to solve our clients’ challenges, our technical expertise and our collaborative spirit are\r\nmeasures of our success.\r\nEach of us is charged with nurturing the firm’s next generation by demonstrating excellence.\r\nAIC has created a culture that embraces diversity, inspires innovation with a purpose to create, enhance and sustain the world’s built, natural and social environments.', 'ALTORATH INTERNATIONAL ENGINEERING CONSULTANTS L.L.C. - Al A\'sam Street - أبو ظبي - الإمارات العربية المتحدة', '24.4727505', '54.37787300000001', 3382, 0, 1, 0, NULL, '2023-06-12 13:21:19', '2024-09-14 14:01:11'),
