(108, 130, 1, 2, 19, 'GULF ASIA CONTRACTING', 'شركة الخليج اسيا للمقاولات', 'MD', 'MANGER', NULL, 'شركة الخليج الآسيوية للمقاولات ذ م م (GAC) هي مقاول عام مشهور في دول مجلس التعاون الخليجي مع خبرة واسعة في الصناعة ولديها عمليات مستمرة في المملكة العربية السعودية وقطر والإمارات العربية المتحدة. ساهمت شركة GAC - مقاول عام مدني وصناعي ذو كفاءة عالية ، بشكل كبير في نمو دول مجلس التعاون الخليجي من خلال مشاريعها التي تشمل مصانع البتروكيماويات ومصافي النفط والغاز والطاقة والمشاريع ذات الصلة بالبنية التحتية مثل المباني التجارية والصناعية والعالية المرافق نهاية. تتفوق الشركة أيضًا في خدمات التشغيل والصيانة والدعم الفني حيث تم توظيف الآلاف من المتخصصين والقوى العاملة الماهرة في دول مجلس التعاون الخليجي. تشتهر GAC أيضًا بخبرتها الواسعة في المجالات التالية من المقاولات العامة: المدنية ، وتشييد المباني ، والأنابيب ، وتصنيع السفن وتركيبها ، وتركيب المعدات ، وأعمال E&I ، والعمليات والصيانة ، والتشغيل المسبق للمحطة ، وإدارة المشاريع. تقدم الشركة أيضًا خدمات الدعم الفني بما في ذلك توريد المهندسين وموظفي إدارة البناء والمتخصصين الفنيين وخاصة من تكنولوجيا المعلومات وكذلك الحرفيين ذوي المهارات العالية لجميع وظائف البناء. بالإضافة إلى ذلك ، تقدم GAC خدمات السقالات الكاملة بما في ذلك التوريد والتركيب. مع وجود قوة عاملة تتجاوز 5800 موظف ، أصبحت GAC لاعباً قوياً في دول مجلس التعاون الخليجي مما مكنها من التفوق باستمرار على منافسيها خاصة في مجالات السلامة والجودة والجدول الزمني', 'GULF ASIA CONTRACTING COMPANY LLC (GAC) is a renowned General Contractor in the GCC with extensive industry experience and having on-going operations in Saudi Arabia, Qatar & UAE. GAC - a highly capable Civil & Industrial General Contractor, has contributed immensely to the growth of the GCC by way of its projects that include Petrochemical Plants, Oil Refineries, Gas & Power, and Infrastructure related projects such as Commercial & Industrial Buildings and High-end utilities. The company also excels in Operations & Maintenance and Technical support services whereby thousands of specialists & skilled manpower have been employed in the GCC. GAC is also renowned for having extensive expertise in the following areas of General Contracting: Civil, Building Erection, Piping, Vessel Fabrication & Erection, Equipment Erection, E&I works, Operations & Maintenance, Plant Pre-commissioning, and Project Management. The company also provides Technical Support Services including supply of Engineers, Construction Management Staff, and Technical Specialists especially from IT as also highly skilled craftsmen for all construction jobs. Additionally, GAC offers full Scaffolding Services including both Supply and Installation. With an employee workforce strength exceeding 5,800 in number, GAC has become a powerful player in the GCC enabling it to consistently out-perform its competitors especially in the areas of SAFETY, QUALITY and SCHEDULE', 'GULF ASIA CONTRACTING CO.L.L.C - طريق الحمرية - عجمان - الإمارات العربية المتحدة', '25.4391734', '55.5544367', 6192, 0, 1, 1, NULL, '2023-07-04 03:34:53', '2024-09-14 14:05:24'),
(109, 131, 1, 3, 19, 'Delta Foundations Co.', 'دلتا للاساسات', 'MD', 'MANGER', NULL, 'شركة متخصصة في المجال الجيوتقني تأسست في مصر منذ عام 1998. الجدير بالذكر أن مؤسسي دلتا لديهم خبرة في مجال الأعمال المدنية والمؤسسات منذ عام 1987.\r\nشركة دلتا للاساسات هي واحدة من الشركات الرائدة وذات الخبرة والاحترام في المجال الجيوتقني من خلال مجموعة متنوعة من المباني ومشاريع البناء في جميع أنحاء الشرق الأوسط.\r\nنظرًا لأن دلتا تهدف إلى النمو والتوسع المستمر في عملياتها ، فقد أنشأت فرعها في الإمارات العربية المتحدة في عام 2004 مما أدى إلى اعتبار دلتا واحدة من أنجح الشركات الجيوتقنية في الإمارات العربية المتحدة ، تلاها إنشاء فرع المملكة العربية السعودية في عام 2007 وحالياً شركة دلتا فاونديشنز. . تسعى إلى مزيد من التوسعات.', 'A specialized corporation in the geotechnical field that has been established in Egypt since the year of 1998. It’s worth mentioning that Delta’s founders have an expertise in the field of civil work and foundations since 1987.\r\nDelta Foundations Co. is one of the leading, experienced and respected companies in the geotechnical field through a diverse range of buildings and construction projects across the Middle East.\r\nSince Delta aims at continuous growth and expansion of its operations, it established its branch in UAE in 2004 leading to Delta being considered one of the most successful geotechnical corporations in the UAE, followed by the establishment of KSA branch in 2007 and currently Delta Foundations Co. is seeking further expansions.', 'Delta Foundation Co - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.3218806', '55.6463037', 3072, 0, 1, 0, NULL, '2023-07-04 03:45:25', '2024-09-14 14:05:50'),
(110, 132, 1, 2, 20, 'HIGH STAR CONTRACTING', 'هاي ستار للمقاولات', 'MD', 'MANGER', NULL, 'شركة هاي ستار للمقاولات (ذ م م) من أكثر الأسماء شهرة في مجال البنية التحتية في الشرق الأوسط. منذ ما يقرب من عقدين من الزمن ، أضافت الشركة طابعها للجودة على مجموعة واسعة من المباني - السكنية والتجارية والصناعية وغيرها. إن أهم ما يميز كل مشروع من مشاريعنا هو أننا ندمج التعقيد بشكل فعال في البساطة ، وهو نهج أكسبنا احترام وإعجاب العديد من العملاء والمهنيين.', 'High Star Contracting Co. (LLC) is among the most reputed names in infrastructure in the Middle East. For close to two decades, the company has added its stamp of quality on a wide range of buildings – residential, commercial, industrial and more. The highlight of each of our projects is that we effectively integrate complexity to simplicity, an approach that has earned us the respect and admiration of several clients and professionals.', 'HIGH STAR CONTRACTING (L.L.C.) - دبي - الإمارات العربية المتحدة', '25.27954630000001', '55.3444698', 699, 0, 1, 0, NULL, '2023-07-04 03:55:41', '2024-09-14 11:34:13'),
(111, 133, 1, 1, 19, 'Mazaya Consulting Engineers', 'مزايا للاستشارات الهندسية', 'MD', 'MANGER', NULL, 'تأسست شركة مزايا للاستشارات الهندسية في عام 1996 ، كمستشار من الدرجة الأولى بهدف تزويد عملائها بأكثر التصاميم ابتكارًا وموثوقية وحداثة لمشاريع فريدة من نوعها. منذ ذلك الحين ، أسست مزايا دورًا بارزًا في مجال التصميم والهندسة مع مشاريع في 8 دول مختلفة من مكاتبنا في جميع أنحاء العالم', 'Mazaya Consulting Engineers was established in 1996, as first class consultant with aim of providing its clients with the most innovative, reliable and modern designs for unique projects. Mazaya have since then established a prominent role in the design and engineering field with projects in 8 different countries from our offices worldwide', 'Mazaya Consulting Engineers, Al MajazAl - شارع الكورنيش - الشارقة - الإمارات العربية المتحدة', '25.3296715', '55.39127999999999', 4554, 0, 1, 1, NULL, '2023-07-04 04:02:53', '2024-09-14 14:05:23'),
(112, 134, 1, 1, 1, 'Al Wasl Al Jadeed Consultants', 'الوصل الجديد للاستشارات', 'MD', 'MANGER', NULL, 'تأسست شركة الوصل الجديد للاستشارات (AWAJ) في عام 1981 ، وهي شركة رائدة في مجال المهندسين المعماريين الاستشاريين ذوي الخبرة الخاصة في تصميم العقارات التجارية والصناعية والسكنية.\r\n\r\nكانت رؤية مؤسسينا هي ملء مكانة مهمة في مجال الهندسة المعمارية وتشكيل ممارسة تصميم محلية لتلبية احتياجات العملاء الفردية في الشرق الأوسط. سرعان ما تطورت ممارستنا إلى شركة متكاملة ، مع إضافة تخصصات محددة مثل الهندسة ، لتكمل خبرتنا المعمارية.\r\n\r\nبصفتنا مؤسسة محلية 100٪ ، فإننا نحتفظ بكادر كامل من المهندسين المعماريين والمخططين مع تقديم الخدمات الاستشارية أيضًا. تشمل حزمة الخدمات التي نقدمها معظم جوانب المشاريع الهندسية ، وهي الهندسة المعمارية وتخطيط المدن والهندسة المدنية والهيكلية والكهربائية والميكانيكية.\r\nهدفنا الرئيسي هو جعل مبانينا جذابة ومستدامة ومبنية لتستمر. نحن نفخر بأنفسنا بقدرتنا على تقديم حلول إبداعية لأي تحدي تصميم يأتي في طريقنا ونقدم دائمًا أفضل تجربة يمكن أن تقدمها شركتنا.\r\n\r\nنحن معروفون بكوننا واحدة من الشركات المعمارية الرائدة في دولة الإمارات العربية المتحدة اليوم ، مع ثلاثة عقود من الخبرة وأكثر من 250 عميل خدمنا. لقد تطورت كفاءتنا وإمكاناتنا بشكل كبير ونحن الآن نلبي احتياجات العملاء في الشرق الأوسط وآسيا وأفريقيا.', 'Founded in 1981, Al Wasl Al Jadeed Consultants (AWAJ) is a leading firm of consulting architects with special expertise in the design of commercial, industrial and residential properties. \r\n\r\nOur founders vision was to fill an important niche in the field of architecture and formed a local design practice to meet individual client needs within the Middle East. Our practice soon developed into an integrated firm, with the addition of specific disciplines like engineering, to compliment our architectural expertise. \r\n\r\nAs a 100% local establishment, we retain a full staff of architects and planners while also providing consulting services. The service package we provide embraces most aspects of engineering projects, namely architectural, town planning, civil, structural, electrical and mechanical engineering.\r\n\r\nOur prime objective is to make our buildings attractive, sustainable and built to last. We pride ourselves with the ability to bring creative solutions to any design challenge that comes our way and always deliver the best experience our firm can offer. \r\nWe are recognized as being one of the leading architectural firms in the UAE today, with three decades of experience and over 250 clients served. Our efficiency and potential has significantly evolved and we now cater to clients in the Middle East, Asia and Africa.', 'Al Wasl Al Jadeed Consultants - دبي - الإمارات العربية المتحدة', '25.18888200000001', '55.26961099999999', 3075, 0, 1, 0, NULL, '2023-07-04 04:16:10', '2024-09-14 14:05:41'),
