(117, 145, 1, 2, 1, 'VOCE INTERNATIONAL CONSTRUCTIONS', 'في او سي اى انتارناشونال للانشاءات', 'md', 'eng', NULL, 'VOCE International هي علامة تجارية متعددة الجنسيات تأسست في عام 2008، وفي فترة قصيرة لا تزيد عن عقد من الزمان تقريبًا، \r\nأصبحت الشركة واحدة من أكثر شركات المقاولات الهندسية والبناء جدارة بالثقة والمؤهلين في الإمارات العربية المتحدة والهند وتنزانيا وإيطاليا.', 'VOCE International is a multinational brand founded in 2008, in short span of almost a decade the company became one of the most trustable and qualified engineering\r\n and construction contractors in the United Arab Emirates, India, Tanzania, and Italy.', 'VOCE INTERNATIONAL CONSTRUCTIONS LLC - دبي - الإمارات العربية المتحدة', '25.1117614', '55.3842473', 498, 0, 1, 0, NULL, '2023-09-26 06:35:07', '2024-09-14 05:54:26'),
