(142, 170, 1, 1, 1, 'PEO Architects Engineering', 'شركة بو اى او للهندسه المعمارية', 'Samar', 'Admin', NULL, 'رواد الخبراء للاستشارات الهندسية (POE) هي منظمة ديناميكية وتقدمية نمت لتصبح واحدة من الشركات الرائدة في مجال الاستشارات الهندسية واستشارات التصميم في دولة الإمارات العربية المتحدة.\r\nنحن نقدم تصميمات باستخدام أحدث التقنيات ونقدم حلولاً فعالة من حيث التكلفة لعملائنا من خلال موظفينا المؤهلين وذوي الخبرة. نحن نفهم سيكولوجية الأعمال في قطاع السوق الإماراتي، مما يجعلنا أكثر منطقية من منافسينا.', 'Pioneers of Experts Engineering Consultants (POE) is a dynamic & progressive organization that has grown to become one of the leading Engineering consultancy & Design consultancy firms in the UAE.\r\nWe provide designs using state of the art technology and provide cost effective solutions to our clients with our qualified and experienced staff. We understand the business psychology of the UAE market sector, thus making us more rationale from our competitors.', 'Pioneers of Experts Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.2511386', '55.3445091', 432, 0, 1, 0, NULL, '2023-10-24 04:11:46', '2024-09-13 18:14:08'),
(143, 171, 1, 2, 20, 'Tiger contracting company', 'شركة تايغر للمقاولات', 'Samar', 'Admin', NULL, 'تأسست مجموعة النمر في عام 1976 برؤية ملهمة للمؤسسين للمشاركة الفعالة في بناء دولة الإمارات العربية المتحدة من خلال تقديم مشاريع بارزة بأعلى معايير الجودة الممكنة التي تتجاوز توقعات عملائنا.\r\n\r\nطوال رحلة نجاحنا، قمنا بتوسيع أعمالنا لتشمل، بالإضافة إلى مشروع البناء والتطوير العقاري، إدارة المرافق والضيافة والتصنيع والتعليم والرعاية الصحية وقمنا بتوسيع منطقتنا الجغرافية التشغيلية لتغطية منطقة الخليج والشرق الأوسط وتركيا.', ']]]]TIGER GROUP was founded in the year 1976 with an inspiring vision of the founders to effectively participate in the building of the United Arab Emirates through delivering landmark projects to the highest possible quality standard that exceed our customers’ expectations.\r\n\r\nThroughout our success journey, we expanded our businesses to include in addition to the Project Construction and Real Estate Development the Facilities Management, Hospitality, Manufacturing, Education and Health Care and extended our operational geographical zone to cover the Gulf Region, Middle East and Turkey.]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]]', 'Tiger Contracting Co LLC - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.3148894', '55.3756395', 528, 0, 1, 0, NULL, '2023-10-24 04:52:19', '2024-09-13 15:27:38'),
(144, 172, 1, 1, 1, 'landmark consulting architects and engineers', 'لاند مارك للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'منذ تأسيسها في عام 2007 في مدينة دبي، الإمارات العربية المتحدة، قدمت لاندمارك خدمات احترافية في مجالها حيث تقدم الهندسة المعمارية الشاملة والهندسة الإنشائية والهندسة المدنية وأنظمة البناء - الهندسة الكهربائية والميكانيكية والتصميم الداخلي وتقييم المرافق وإدارة المشاريع وأكثر من ذلك بكثير بما يتجاوز توقعات عملائنا. .\r\n\r\nمع \"ترخيص غير محدود\" من بلدية دبي لتنفيذ جميع أنواع وأحجام تصميمات المباني، أصبحت لاندمارك واحدة من الشركات المعروفة في دبي واكتسبت سمعة طيبة بسبب الإنجازات التي حققتها خلال السنوات الماضية.\r\n\r\nيقدم فريق الإدارة التنفيذية للشركة عقودًا من الخبرة في مجال صناعة الإلكترونيات المتقدمة مع مجموعة قوية من المشاريع المتنوعة في الحجم والتعقيد المقدمة للعملاء البارزين في دولة الإمارات العربية المتحدة.', 'Since established in 2007 in the city of Dubai, UAE, LANDMARK performed a professional services in its feild offering comprehensive architectural, structural engineering, civil engineering, building systems - MEP, interior design, facilities assessment, project management and much more beyond our customer expectations.\r\n\r\nWith an ‘Unlimited License’ by Dubai Municipality to carry out all types and sizes of buildings designs, LANDMARK became one of the well known firms in Dubai and gained a respectful reputation due to the acheivements during the past years.\r\n\r\nThe firm’s executive management team offers decades of experience in the AEC industry with solid portfolio of projects varying in size and complexity delivered for high profile clients in  UAE.', 'LANDMARK ENGINEERING CONSULTANT, Office C1202 - دبي - الإمارات العربية المتحدة', '25.1854433', '55.2618246', 486, 0, 1, 0, NULL, '2023-10-24 05:10:17', '2024-09-12 15:09:56'),
(145, 173, 1, 2, 19, 'Eliya Building Contracting LLC', 'شركة ايليا لمقاولات البناء', 'Samar', 'Admin', NULL, NULL, NULL, 'ELIYA building contracting llc - شارع مؤتة - عجمان - الإمارات العربية المتحدة', '25.395871', '55.4935456', 2367, 0, 1, 0, NULL, '2023-10-24 05:23:01', '2024-09-13 10:57:23'),
(146, 174, 1, 1, 1, 'RENAISSANCE ENGINEERING CONSULTANT', 'النهضـــة للإستشارات الهندسية', 'Samar', 'Admin', NULL, 'يسعد شركة النهضة للاستشارات الهندسية (REC) الموجودة في دبي، مشاركة نجاحنا مع عملائنا الكرام. نحن نفخر بقدرتنا على تطوير علاقات قوية وطويلة الأمد مع عملائنا. تعتمد فلسفتنا على النهج التعاوني، والعمل بشكل وثيق مع العملاء لتحقيق أقصى قدر من نتائج المشروع. نحن نؤمن بالتفاني والاهتمام الخاص بالإبداع في مجال التصميم والمتابعة والتنفيذ، والوفاء الكامل بالتزاماتنا، والهيكل التنظيمي المرن القادر على التكيف مع المشاريع ذات المعايير المتنوعة. الاستغلال الأمثل للمشاريع في حدود الميزانية بما يحقق الانسجام بين عنصري الجمالية والجودة.', 'Renaissance Engineering Consultants  (REC)  located in Dubai, are happy to share our success with our valued clients. We pride ourselves on our ability to develop strong and long-lasting relationships with our clients. Our philosophy is based on a collaborative approach, working closely with clients to maximize project outcomes. We believe in dedication and special attention to creativeness in the field of design, follow-up and execution, complete fulfillment of our obligations, flexible organizational structure which is able to adapt to projects of diversified criteria. Optimum exploitation of projects within budget in order to achieve harmony between both elements of aesthetics and quality.', 'Renaissance Engineering Consultants - شارع الرشيد - دبي - الإمارات العربية المتحدة', '25.2951019', '55.3510351', 462, 0, 0, 0, NULL, '2023-10-24 05:33:34', '2024-09-14 13:55:29'),
(147, 175, 1, 2, 1, 'Al Baraka Construction Co. L.L.C', 'شركة البركة للانشاءات المحدودة', 'Samar', 'Admin', NULL, NULL, NULL, 'Al Baraka Construction L.L.C شركة البركة للإنشاءات ذ.م.م - دبي - الإمارات العربية المتحدة', '25.0916732', '55.3159195', 3051, 0, 1, 0, NULL, '2023-10-24 05:48:31', '2024-09-14 14:05:32'),
(148, 176, 1, 1, 1, 'Ridge Engineering Consultants', 'ريدج للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'حققت شركة ريدج للاستشارات الهندسية (REC) مكانة خاصة بها في سوق الإمارات العربية المتحدة، وأصبحت رائدة في تصميم البناء والتطوير والإدارة. منذ إنشائها، سعت شركة REC جاهدة إلى تجاوز توقعات العملاء وتوقعاتها الخاصة ورفع معايير الاستشارات المهنية والهندسة من خلال وجود فريق متزايد من المتخصصين في الصناعة الموهوبين والمؤهلين وذوي الخبرة الذين يتمتعون بالقدرة والشخصية اللازمة للفهم والتغلب. تحديات بناء وصيانة المشاريع الحديثة. تنتشر بصمة نجاح REC بشكل جيد في مختلف قطاعات الصناعة. إن النجاح والدعم هما نتيجة الإيمان المطلق بفريقنا وخبرته، وقدرته على رؤية كل مشروع حتى اكتماله المنشود.', 'Ridge Engineering Consultants (REC) has carved a niche for itself in the UAE market, and become a leader in construction design, development and management. Ever since inception, REC has strived to continually exceed customers’ and its own expectations and raise the benchmarks of professional consulting and engineering by having a growing team of supremely talented, qualified, and experienced industry professionals who have the caliber and character to understand and overcome the challenges of modern project building and maintenance. REC success footprint is well-spread across different industry sectors. The success and sustenance are the outcome of sheer belief in our team and their expertise, and their ability to see through each project to its desired completion.', 'Ridge Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.2466672', '55.34256869999999', 321, 0, 1, 0, NULL, '2023-10-28 05:09:26', '2024-09-14 14:12:12'),
(149, 177, 1, 2, 1, 'Turan Building Contracting LLC', 'توران لمقاولات البناء ذ.م.م', 'Samar', 'Admin', NULL, 'توران لتشييد المباني هي شركة إنشاءات مرموقة وراسخة ولها سجل حافل في تقديم مشاريع عالية الجودة في مختلف القطاعات. تأسست الشركة بهدف تقديم حلول بناء موثوقة ومبتكرة تتجاوز توقعات العملاء.', 'Turan Building Construction is a reputable and established construction company with a proven track record of delivering high-quality projects across various sectors. The company was founded with a mission to provide reliable and innovative construction solutions that exceed client expectations.', 'Square Tower by Tiger Properties - دبي - الإمارات العربية المتحدة', '25.0465176', '55.2060796', 456, 0, 1, 0, NULL, '2023-10-28 05:18:42', '2024-09-12 18:42:42'),
(150, 178, 1, 2, 1, 'Al Fursan Contracting', 'الفرسان للمقاولات', 'Samar', 'Admin', NULL, 'تلتزم شركة الفرسان بمساعيها لتنفيذ العقد بما يرضي جميع أصحاب المصلحة خلال الفترة المحددة وضمان أفضل معايير الجودة والسلامة. إظهار الالتزام بالجودة لأول مرة وفي الوقت المحدد وفي كل مرة.', 'Al Fursan stands committed in its endeavors to execute the contract to the entire satisfaction of its stakeholders within the stipulated period and assuring the best quality and safety standards. demonstrate commitment to quality first time, on time and every time.', 'AL FURSAN CONTRACTING LLC، Al Diyafa Building - Al Mankhool Road - دبي - الإمارات العربية المتحدة', '25.2375621', '55.2791213', 3681, 0, 1, 0, NULL, '2023-10-28 05:31:06', '2024-09-14 14:05:32'),
(151, 179, 1, 1, 21, 'Adcon Consultants Engineers', 'ادكون للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة أدكون للاستشارات الهندسية في عام 1995 كشركة هندسية استشارية متخصصة في الخدمات الهندسية. منذ إنشائها وهي متخصصة في تصميم الفلل والمباني العامة والتجارية والسكنية.\r\nلقد شارك مهندسو Adcon Consultants في عملية التطوير في الدولة لأكثر من 10 سنوات وسيظلون شريكًا نشطًا وأحد الاستشاريين الرائدين في دولة الإمارات العربية المتحدة.\r\nالهدف الأساسي لمهندسي Adcon Consultants هو جعلها متاحة على المستوى الدولي، وتنتشر الخدمات عبر سلسلة كاملة من التصميم والإدارة والبناء.', 'Adcon Consultant engineers was founded in 1995 as a consulting engineering firm specializing in engineering services.Since inception it has been specializing in the design of villas and public,commercial and residential buildings.\r\nAdcon Consultant engineers have been part if the development process in the country for more than 10 years and will continue to be an active partner and one of the leading Consultants in United Arab Emirates.\r\nThe primary objective Adcon Consultant engineers  is to make it available at the international level, the services spread over the gamut of design, management and construction.', 'Adcon Consultants Engineers LLC. - أبو ظبي - الإمارات العربية المتحدة', '24.4710474', '54.3393032', 3999, 0, 1, 0, NULL, '2023-10-28 05:45:28', '2024-09-14 14:05:31'),
