(153, 181, 1, 2, 21, 'Emirates & Al Nasr Building & Construction LLC', 'الامارات والنصر للمبانى والانشاءات ذ.م.م', 'Samar', 'Admin', NULL, NULL, NULL, 'Emirates & Al Nasr Building & Contracting Co - Sheikh Hamdan Bin Mohammed Street (Hamdan Street) - أبو ظبي - الإمارات العربية المتحدة', '24.4949063', '54.3698609', 2943, 0, 1, 0, NULL, '2023-10-30 12:16:30', '2024-09-14 08:54:24'),
(154, 182, 1, 1, 21, 'Bainona Engineering Consultancy', 'بينونة للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة بينونة للاستشارات الهندسية ذ.م.م في عام 1994. (BEC) مصنفة كمستشار من الدرجة \"الخاصة\" في مجالات التصميم والإشراف على البناء.\r\n\r\nسمحت لنا قيمنا وتاريخنا وخبرتنا الواسعة بالحصول على اعتراف المطورين المرموقين من مختلف الصناعات. في BEC، هدفنا هو إلهام أفق الغد من خلال وضع معايير للخدمات الهندسية اليوم.', 'stablished in 1994, Bainona Engineering Consultancy L.L.C. (BEC) is classified as a “Special” grade consultant in the fields of Design & Construction Supervision.\r\n\r\nOur values, history & wide expertise allowed us to earn the recognition of highly regarded developers from various industries.At BEC, our aim is to inspire the skylines of tomorrow by setting the standard for engineering services today.', 'Bainona Engineering Consultancy - LLC - أبو ظبي - الإمارات العربية المتحدة', '24.4548125', '54.33856249999999', 330, 0, 1, 0, NULL, '2023-10-30 12:24:57', '2024-09-13 17:47:54'),
(155, 183, 1, 2, 1, 'Majestic Mountains Building Contracting LLC', 'شركة الجبال الشامخة لمقاولات البناء ذ.م.م', 'Samar', 'Admin', NULL, 'L.L.C (MMBC) هي شركة مرموقة في الإمارات العربية المتحدة. صناعة البناء والتشييد. تشكلت في عام 2006.\r\n\r\nشركة MMBC هي مقاول رئيسي معتمد G+12 وهي واحدة من شركات المقاولات الرائدة في دبي، الإمارات العربية المتحدة.\r\n\r\nإنجاز مشاريع مثيرة للإعجاب باستخدام أساليب متطورة، وقياس معايير الجودة العالية والسلامة والأداء الوظيفي والجماليات.\r\n\r\nتتكون شركة MMBC من أكثر من 200 من المهندسين الخبراء والمهنيين المتخصصين في مشاريع البناء السكنية والتجارية والصناعية من مختلف المناطق في دبي، والمعترف بها من قبل جميع المطورين الرئيسيين والسلطات المحلية.', 'L.L.C (MMBC) is a reputed company in The U.A.E. construction industry. Formed in 2006.\r\n\r\nMMBC is a certified G+12 Main Contractor and is one of the leading contractors in Dubai, United Arab Emirates.\r\n\r\nAccomplishing impressive projects using high-end methods, measuring up to superior standards for quality, safety, functionality, and aesthetics.\r\n\r\nMMBC consists of over 200 expert engineers & professionals specialized in residential, commercial, and industrial construction projects from various areas in Dubai, Recognized by all master developers and local authorities.', 'Majestic Mountains Building Contracting LLC - 2nd - behind NMC Hospital - دبي - الإمارات العربية المتحدة', '25.2875712', '55.36892789999999', 288, 0, 1, 0, NULL, '2023-10-30 12:34:16', '2024-09-14 09:30:40'),
