(158, 186, 1, 2, 5, 'AL REHAB BUILDING CONTRACTING LLC', 'شركه شركة الرحاب العربي لمقاولات البناء ش ذ م م', 'Samar', 'Admin', NULL, 'تقوم مجموعة الرحاب بإنشاء وبناء والإشراف وإدارة المشاريع التي من شأنها أن تصنع في نهاية المطاف مجتمعًا أفضل ومستقبل أكثر إشراقًا.\r\n\r\nوباعتبارنا إحدى شركات البناء الرائدة في دولة الإمارات العربية المتحدة، فإننا نتوسع في قدراتنا المتعددة التخصصات ونقدم إدارة واستشارات شاملة في مجال الهندسة والبناء.\r\n\r\nتركز شركة الرحاب للإنشاءات على نقل الترتيبات الإبداعية التي تلبي احتياجات العملاء الحقيقية.\r\n\r\nمع خلفية تتميز بالإنجازات والعلاقة القوية مع المنظمات الشقيقة، فإننا نزود عملائنا بطريقة مدمجة لبناء نقل المشاريع في عالم العولمة المتقدم.\r\n\r\nاستباقيًا بدلًا من الاستجابة، نحن في الخط الأمامي للشراكات الجديدة والمفيدة.', 'Al Rehab group creates, builds, supervises and manages projects that will eventually make a better society and a brighter future.\r\n\r\nAs one of the leading construction companies in the UAE, we expand on our demonstrated multidisciplinary capablility and offer comprehensive engineering and building management and consultaion.\r\n\r\nAl Rehab construction concentrates on conveying creative arrangements that meet customer\'s genuine needs.\r\n\r\nWith a background marked by achievement and a solid relationship with sister organizations, we furnish our customers with an incorporated way to build venture conveyance in the advancing globalized world.\r\n\r\nProactive instead of responsive, we are at the front line of new forte and beneficial partnerships.', 'Al Rehab Building Contracting - alshaikh rashid binhamed st - عجمان - الإمارات العربية المتحدة', '25.396989', '55.4310387', 2739, 0, 1, 0, NULL, '2023-10-30 13:16:37', '2024-09-14 14:10:55'),
(159, 187, 1, 1, 1, 'OSUS INTERNATIONAL ENGINEERING CONSULTANTS', 'شركة أوسيس العالمية للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'الدولية للاستشارات الهندسية هي شركة رائدة في مجال الاستشارات الهندسية والإدارية تأسست في الشارقة، الإمارات العربية المتحدة في عام 2006، وتكرس نفسها للتميز في تقديم الخدمات المهنية في أربعة مجالات رئيسية: الهندسة والإدارة والتدريب وبناء القدرات، وتكنولوجيا المعلومات.', 'INTERNATIONAL Engineering Consultants is a leading Engineering and Management consultancy firm established in Sharjah, UAE in 2006, devoting itself to excellence in providing professional services in four major areas: Engineering, Management, Training and Capacity Building, and Information Technology.', 'OSUS INTERNATIONAL ENGINEERING CONSULTANT - دبي - الإمارات العربية المتحدة', '25.2869478', '55.358322', 411, 0, 1, 0, NULL, '2023-10-30 13:26:51', '2024-09-14 13:23:41'),
