(161, 189, 1, 1, 1, 'HAO architects', 'اتش اى او المعمارية', 'Samar', 'Admin', NULL, 'HAO Architects هو استوديو تصميم متعدد التخصصات مقره في دبي، أسسه مانوج إتش راثود. إيماننا الأساسي بالشركة هو \"الابتكار والبساطة\".', 'HAO Architects is multi-disciplinary design studio based in Dubai founded by Manoj H Rathod. Our Fundamental belief of the firm is “innovation & simplicity”.', 'HAO Architects - شارع الميناء - دبي - الإمارات العربية المتحدة', '25.2592233', '55.2851527', 1482, 0, 1, 0, NULL, '2023-10-31 12:44:10', '2024-09-14 13:28:00'),
(162, 190, 1, 3, 1, 'PAI POWER AXES INTERNATIONAL FOUNDATION', 'باور أكسس العالمية', 'Samar', 'Admin', NULL, 'باور اكسس هي إحدى شركات مقاولات الأساسات الرائدة في الإمارات العربية المتحدة ومصر، مسجلة كشركة مقاولات في مجال إنشاء الأساسات والأعمال المدنية.', 'Power Axes is one of the leading foundation contracting companies in U.A.E and Egypt, registered as a contracting firm in the field of foundation and civil work construction.', 'Power Axes piling and foundation, Office 2301 - شارع الأعمال - دبي - الإمارات العربية المتحدة', '25.1858744', '55.2622604', 2520, 0, 1, 0, NULL, '2023-10-31 13:03:16', '2024-09-14 14:05:50'),
