(164, 192, 1, 1, 1, 'ORIENT CROWN ARCHITECTURAL', 'أورينت كراون للهندسة المعمارية', 'Samar', 'Admin', NULL, 'أورينت كراون هي شركة استشارات معمارية وهندسية مقرها في دبي، الإمارات العربية المتحدة. تأسست في عام 2014 من قبل رضا كمران وهي مسجلة في بلدية دبي، تراخيص، تيكوم، اتصالات، DCD، RAT، ديوا.\r\n\r\nأورينت كراون هي شركة رائدة في مجال الاستشارات الهندسية في التصميم والإشراف وإدارة المشاريع، وتغطي أورينت كراون عددًا من التطورات الناجحة، بما في ذلك المباني السكنية والفلل والمباني التجارية والمستشفيات والمشاريع الصناعية.', 'Orient Crown is an architecture and engineering consultancy based in Dubai, United Arab Emirates. It’s established in the year of 2014 by Reza Kamran and It’s registered in Dubai municipality (DM), Trakhees ,TECOM , Etisalat , DCD , RAT, DEWA .\r\n\r\nOrient Crown is a leading Engineering Consultants in design, supervision and project management, Orient Crown covers a number of successful developments, including residential buildings and villas, commercial buildings, hospitals, and industrial projects.', 'ORIENT CROWN ARCHITECTURAL - مراسي درايف - دبي - الإمارات العربية المتحدة', '25.1842421', '55.2597031', 1569, 0, 1, 0, NULL, '2023-10-31 13:22:07', '2024-09-14 13:46:31'),
