(167, 195, 1, 1, 1, 'NEXT Engineering Consultants', 'نكست للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'في شركة NEXT للاستشارات الهندسية، نشارك المعرفة ونتخيل طرقًا جديدة لحل تحديات البيئة المبنية.\r\n\r\nنحن نقدم تغطية كاملة لخدمات مستشارينا التي تشمل الخدمات المعمارية والإنشائية والكهربائية والميكانيكية للتصميمات.\r\n\r\nيتمتع فريقنا في شركة نكست للاستشارات الهندسية بخبرة واسعة وأشخاص موهوبين في قلب نجاحنا. نحن متخصصون في تصميم جميع أنواع المباني.\r\nسيكون فريق NEXT خطوة بخطوة دائمًا عند حاجة العميل وسيختبر تحديثات مهمة ومفصلة تهدف إلى الوصول إلى نتيجة المشروع من أجل الاستجابة لأفضل تجربة للعميل.\r\n\r\nهدفنا الأساسي هو التواجد في السوق المحلي والدولي في تصميم وإدارة وبناء المجالات.\r\n\r\nفي شركة NEXT للاستشارات الهندسية، مهمتنا هي تحويل رؤية عملائنا إلى واقع ملموس.\r\n\r\nنحن نفخر بتقديم أفكار وحلول تصميمية استثنائية لعملائنا من خلال المزج المبتكر بين الاحتياجات البشرية والتطورات الحضرية.', 'In NEXT engineering consultants, we share knowledge and imagine new ways to solve the challenges of the built environment.\r\n\r\nWe provide full coverage of our consultant\'s services that include the architectural, structural, electrical, and mechanical services of the designs.\r\n\r\nOur team at next engineering consultants has wide experience and talented people at the heart of our success, .we are specialized in designing all kinds of buildings.\r\nNEXT team step by step, will always be at the client\'s need that will experience significant and detailed updates aimed at reaching the project result in order to respond to the client\'s best experience.\r\n\r\nOur primary goal is our presence in the domestic and international market in designing, managing and building fields.\r\n\r\nAt NEXT engineering consultants, our mission is to shape our client\'s vision into reality.\r\n\r\nWe proudly deliver exceptional design ideas and solutions for our client\'s through the innovative blending of human needs and urban developments.', 'Next Engineering Consultants, Next Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.1118785', '55.3843578', 444, 0, 1, 0, NULL, '2023-11-05 13:19:13', '2024-09-14 14:04:53'),
(168, 196, 1, 1, 1, 'DEC Dynamic Engineering Consultants', 'دي إي سي للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'نحن شركة استشارية إقليمية للتصميم الهندسي تعمل في منطقة الشرق الأوسط، ولدينا سجل حافل في تقديم الحلول الإبداعية لأكثر المشاريع تحديًا.\r\n\r\nكما يشير اسمنا، دي إي سي للاستشارات الهندسية الديناميكية، نحن شركة ديناميكية ومتنامية، تركز على تلبية الاحتياجات المتغيرة لعملائنا.\r\n\r\nموظفونا هم سر نجاحنا. ومن خلال تسخير خبراتهم، فإننا نقدم باستمرار قيمة للعملاء في المشاريع حول العالم.', 'We are an established regional Engineering Design consultant operating in the Middle East region, with a strong track record of providing creative solutions for the most challenging of projects.\r\n\r\nAs our name, DEC Dynamic Engineering Consultants suggests, we are a dynamic and growing business, focused on meeting the changing needs of our Clients.\r\n\r\nOur people are the secret of our success. By harnessing their expertise, we are consistently delivering value for Clients on projects around the world.', 'DEC • Dynamic Design Studio LLC - دبي - الإمارات العربية المتحدة', '25.0979671', '55.15618509999999', 435, 0, 1, 0, NULL, '2023-11-05 13:39:53', '2024-09-14 14:19:48'),
(169, 197, 1, 2, 1, 'Al Ishrak Contracting Co. LLC', 'شركة الإشراق للمقاولات ذ.م.م', 'Samar', 'Admin', NULL, 'تأسست شركة الإشراق للمقاولات (ذ.م.م) أعمالها في إمارة دبي عام 1975 ونجحت في تنفيذ أعمال البناء في مجموعة متنوعة من المستودعات الصناعية والسقائف ومساكن العمال والمباني السكنية والتجارية والفلل والمساجد وما إلى ذلك إلى جانب وظائف الهندسة المدنية. على أساس تسليم المفتاح.', 'Al Ishrak Contracting Company (L.L.C.) established business in the Emirates of Dubai in 1975 and has been successfully carried out Construction works in variety of Industrial Warehouses, Sheds, Labour Accommodations, Residential & Commercial buildings, Villas, mosques etc. along with Civil Engineering jobs on turnkey basis.', 'Al Ishrak Contracting Co. LLC - دبي - الإمارات العربية المتحدة', '25.1700063', '55.3427313', 3015, 0, 1, 0, NULL, '2023-11-05 13:48:31', '2024-09-14 14:05:45'),
(170, 198, 1, 2, 1, 'Globe Building Contracting', 'جلوب لمقاولات البناء', 'Samar', 'Admin', NULL, 'تأسست شركة غلوب لمقاولات البناء في عام 1990 وتقدم حلولاً من الدرجة الأولى في التصميم والهندسة والبناء لكبار العملاء في صناعة البناء والتشييد في دولة الإمارات العربية المتحدة. مع سنوات من الخبرة تحت حزامنا، قمنا ببناء سمعة طيبة من التميز والجودة التي لا مثيل لها في هذه الصناعة. نحن فخورون بوجود فريق من المهنيين الفنيين والهندسيين ذوي الخبرة الذين يكرسون جهودهم لضمان الأداء المتفوق في كل ما نقوم به.', 'Globe Building Contracting Founded in 1990 and has been delivering top notch design, engineering and construction solutions to major clients of the construction industry in the United Arab Emirates. With years of experience under our belt, we have built a reputation for excellence and quality that is unmatched in the industry. We are proud to have a team of experienced technical and engineering professionals who are dedicated to ensuring superior performance in everything we do.', 'Globe Building Contracting LLC - دبي - الإمارات العربية المتحدة', '25.2898067', '55.35406509999999', 1617, 0, 1, 0, NULL, '2023-11-05 14:01:51', '2024-09-14 08:58:52'),
(171, 199, 1, 1, 1, 'LACASA Architects & Engineering Consultants', 'لاكاسا للهندسة المعمارية والاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست لاكاسا منذ أكثر من عقد من الزمن على يد عماد جابر ونبيل الخاجة، وأصبحت واحدة من أكثر شركات التصميم المعماري متعددة التخصصات إنجازًا في المنطقة مع محفظة متنوعة تغطي جميع أنواع التطويرات.\r\n\r\nبفضل فريق موهوب من المهندسين المعماريين والمهندسين ذوي الخلفيات المهنية المتنوعة، قمنا بتصميم أكثر من 250 مشروعًا يتكون من مشاريع سكنية وتجارية وضيافة ومتعددة الاستخدامات بالإضافة إلى المخططات الرئيسية والتصميمات الداخلية.\r\n\r\nونحن نسعى جاهدين لتزويد عملائنا بأعلى جودة التصاميم والخدمات. بينما يقال أنه لا يوجد شيء مثالي، فإننا نؤمن أنه يمكن تحقيق الكمال في التصميم من خلال تنمية المواهب الاستثنائية والمتنوعة. تقوم إدارتنا بذلك من خلال دعم فريق المهندسين المعماريين أثناء تعلمهم وابتكارهم وتطورهم.\r\n\r\nلا يقتصر هدفنا على مواكبة الاتجاهات المتغيرة في الصناعة فحسب، بل نطمح أيضًا إلى التأثير عليها والمساهمة في تقدم الهندسة المعمارية في المنطقة.', 'Founded over a decade ago by Emad Jaber & Nabil Al Khaja, LACASA has become one of the most accomplished multidisciplinary Architectural Design firms in the region with a diverse portfolio spanning all types of developments.\r\n\r\nThanks to a talented team of Architects and Engineers with various professional backgrounds, we have designed over 250 projects consisting of residential, commercial, hospitality, and mixed-use developments as well as master plans and interior designs.  \r\n\r\nWe strive to provide our clients with the highest quality designs and services. While it is said that nothing is perfect, we believe that perfection in design can be achieved by cultivating extraordinary and diverse talent. Our management does so by supporting its team of architects as they learn, innovate, and evolve. \r\n\r\nOur aim isn\'t only to keep up with the changing trends in the industry, but also aspire to influence them and contribute to the advancement of architecture in the region.', 'LACASA Architects & Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.047697', '55.230509', 513, 0, 1, 0, NULL, '2023-11-05 14:09:28', '2024-09-13 13:27:52'),
(172, 200, 1, 1, 1, 'Urban Habitat Architectural Consultants', 'الموطن الحضري للاستشارات المعمارية', 'Samar', 'Admin', NULL, NULL, NULL, 'Urban Habitat Architectural Consultants - دبي - الإمارات العربية المتحدة', '25.1854241', '55.28014140000001', 360, 0, 1, 0, NULL, '2023-11-05 14:27:31', '2024-09-14 09:08:31'),
(173, 201, 1, 2, 1, 'Future Towers Contracting', 'أبراج المستقبل للمقاولات', 'Samar', 'Admin', NULL, 'نحن، أبراج المستقبل للمقاولات، ملتزمون بجودة العمل الذي سيضمن أن العمل المنجز سيكون على مستوى عالٍ وسيلبي بشكل مناسب المتطلبات كما هو موضح في قواعد الممارسة أو المعايير الدولية المعترف بها، والمتطلبات القانونية ومواصفات العميل', 'We, FUTURE TOWERS CONTRACTING, are committed to a quality work which will ensure that work carried out will be of high standard and will adequately address the requirements as described in recognized International Codes of Practice or standards, Statutory requirements and client specificationذذذذ', 'Future Towers Contracting - دبي - الإمارات العربية المتحدة', '25.2382647', '55.2765889', 2817, 0, 1, 0, NULL, '2023-11-05 15:02:06', '2024-09-14 08:54:23'),
(174, 202, 1, 1, 1, 'Golden Square Engineering Consultants', 'جولدن سكوير للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست جولدن سكوير للاستشارات الهندسية عام 2001*\r\nجولدن سكوير للاستشارات الهندسية هي شركة تخطيط وتصميم متعددة التخصصات تقدم خدمات احترافية شاملة لمواجهة تحديات القرن الحادي والعشرين. لقد عملنا مع كبار المالكين والمطورين والمقاولين والاستشاريين على مجموعة كاملة من التصميم والعطاء والبناء، كمصمم ومراجعين أقران وخبير خارجي. نحن نعمل معًا خلال جميع مراحل المشروع لتطوير حلول تصميمية مجدية ومستدامة لعملائنا في كل من القطاعين العام والخاص', 'Golden Square Engineering Consultants was founded in 2001*\r\nGolden Square Engineering Consultants is a multi-disciplinary planning and design firm which offers comprehensive professional services to meet the challenges of the 21 St century. We have worked with a major owners, developers, contractors, consultants on the full range of design-bid-build design-build, as a designer, peer reviewers and third party expert. We work together through all project stages to develop feasible and sustainable design solution for our clients in both the public and private sector', 'Golden Square Engineering Consultants - شارع شاطئ جميرة - دبي - الإمارات العربية المتحدة', '25.1588458', '55.2072797', 462, 0, 1, 0, NULL, '2023-11-10 15:18:05', '2024-09-14 14:27:15'),
(175, 203, 1, 2, 5, 'Modern Building Contracting', 'شركة العمارة الحديثة المقاولات', 'Samar', 'Admin', NULL, 'شركة العمارة الحديثة المقاولات هي واحدة من شركات المقاولات الرائدة في الإمارات العربية المتحدة.\r\n\r\nنفذت مشاريع في دبي والشارقة وعجمان ورأس الخيمة و لبنان وسوريا.\r\n\r\nشركتنا لها تاريخ مشرق في تنفيذ مجموعة واسعة من القطاعات العقارية، مثل المباني السكنية والتجارية وألابراج والمستشفيات والجامعات والمدارس والفلل والمجمعات الحكومية.\r\n\r\nشركة العمارة الحديثة المقاولات لديها اكثر من 3000 موظف.', 'Modern Architecture Contracting Company is one of the leading contracting companies in the United Arab Emirates.\r\n\r\nImplemented projects in Dubai, Sharjah, Ajman, Ras Al Khaimah, Lebanon and Syria.\r\n\r\nOur company has a bright history in implementing a wide range of real estate sectors, such as residential and commercial buildings, towers, hospitals, universities, schools, villas and government complexes.\r\n\r\nModern Architecture Contracting Company has more than 3,000 employees.', 'Emarat- Al Rumaila - Ajman - عجمان - الإمارات العربية المتحدة', '25.4085502', '55.43683799999999', 417, 0, 1, 0, NULL, '2023-11-10 15:31:09', '2024-09-12 19:44:53'),
(176, 204, 1, 2, 1, 'Mega Tech Pilling Contracting & Foundation LLC', 'ميجا تك للمقاولات والأساسات ذ.م.م', 'Samar', 'Admin', NULL, 'مؤسسة Mega Tech هي عضو في مجموعة MEGATECH وهي واحدة من أفضل الشركات المتقدمة والتقدمية بالكامل في الإمارات العربية المتحدة ومصر والمملكة العربية السعودية. 25 عامًا من الخبرة تعتمد على المشاريع الكبرى التي أنشأها فريق من المهندسين وموظفي الدعم المؤهلين والمتحمسين للغاية. لقد بنت سمعتها من خلال إدخال أحدث التقنيات والتطوير والتصميم والتخطيط والجدولة وتنفيذ المشاريع.', 'Mega Tech Corporation is a member of MEGATECH Group and is one of the best fully developed and progressive companies in UAE, Egypt and Saudi Arabia. 25 years of experience based on major projects created by a team of qualified and highly motivated engineers and support staff. It has built its reputation by introducing the latest technologies, development, design, planning, scheduling and project execution.', 'Mega Tech Repair Piling & Foundation - شارع عمان - Dubai - الإمارات العربية المتحدة', '25.2916578', '55.396684', 330, 0, 1, 0, NULL, '2023-11-10 16:25:39', '2024-09-12 14:55:04'),
(177, 205, 1, 1, 1, 'CVTEC Consulting Engineers', 'ٍسفتيك للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة CVTEC في دبي عام 2005 كشركة استشارات معمارية وهندسية متعددة التخصصات. تقدم الشركة حلول تصميم شاملة في الهندسة المعمارية والتخطيط الرئيسي والتصميم الداخلي والهندسة والتخطيط وإدارة المشاريع مع شبكة عالمية من المتخصصين في البنية التحتية والمناظر الطبيعية والصوتيات وتصميم الإضاءة والتصميم المستدام وغيرها.\r\nيدير الفريق بشكل فعال مجموعة واسعة من تطوير المشروع من البداية إلى مرحلة ما بعد البناء والتشغيل. كفريق متعدد التخصصات، تعتمد CVTEC على الخبرة الأساسية لكل من شركائها الدوليين لخلق تآزر فريد من نوعه، مما يضمن تطوير المشاريع المنفذة وتنفيذها بنجاح لتحقيق أفضل مصلحة للمستثمرين والمستخدمين النهائيين.', 'CVTEC was established in Dubai in 2005 as a multi-disciplinary Architectural and Engineering Consultancy. The firm offers comprehensive design solutions in Architecture, Master Planning, Interior Design, Engineering, Planning, and Project Management with a global network of specialists in Infrastructure, Landscaping, Acoustics, Lighting Design, and Sustainable Design among others. \r\nThe team effectively manages a wide spectrum of project development from inception to post-construction and operation. As a multi-disciplinary team, CVTEC draws on each of their international associates’ core expertise to create a unique synergy, ensuring that the projects undertaken are successfully developed and implemented to the best interest of the investors and the end users.', 'Ontario Tower, P3 Floor, Office No. 01&02 - Al Amal St - الخليج التجاري - دبي - الإمارات العربية المتحدة', '25.1857267', '55.2623633', 1275, 0, 1, 0, NULL, '2023-11-10 16:35:07', '2024-09-14 13:53:29'),
(178, 206, 1, 1, 1, 'Shadid Engineering Consultants', 'شديد للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'شديد للاستشارات الهندسية (SEC) هي إحدى الشركات الرائدة في مجال الاستشارات الهندسية، تأسست في دبي عام 1983، للمشاركة في صناعة البناء والتشييد، والمساهمة بفعالية في عملية البناء والتطوير التي تشهدها دولة الإمارات العربية المتحدة والمنطقة .\r\n\r\n\r\nاشتهرت المشاريع التي أنجزتها الشركة السعودية للكهرباء بجودتها ومعاييرها العالية والوعي البيئي والسلامة وإنجاز المشاريع في الوقت المحدد.', 'Shadid Engineering Consultants (SEC) is one of the pioneering companies in the field of Engineering Consultancy, established in Dubai in 1983, to take part in the construction industry, and contribute actively to the process of construction and development undergoing in the UAE and the region.\r\n\r\n\r\nrojects completed by SEC were renown for their quality, high standards, environmental awareness , safety, and on time completion of projects.', 'Shadid Engineering Consultants (Head Office) - دبي - الإمارات العربية المتحدة', '25.1209064', '55.3722447', 447, 0, 1, 0, NULL, '2023-11-10 16:44:04', '2024-09-13 23:19:08'),
(179, 207, 1, 2, 1, 'progress constructions llc', 'التقدم للإنشاءات', 'Samar', 'Admin', NULL, 'تلتزم شركة Progress Constructions بتجاوز توقعات عملائنا والمقاولين من الباطن والموردين؛ من خلال تجاوز الأداء المتوقع من خلال النزاهة والكفاءة المهنية والخدمة التي تنتج مشاريع بناء عالية الجودة.\r\n\r\nيتكون فريق التقدم للإنشاءات من المتفوقين الذين يحرصون على حصول عملائنا على الأفضل.\r\n\r\nتؤمن شركة Progress Constructions بأن الأفراد المتميزين ينتجون مشاريع عالية الجودة. التميز هو هدفنا وكذلك التزامنا تجاه عملائنا. بدءًا من خدمات ما قبل البناء وحتى إكمال المشروع، تلتزم شركة Progress Constructions بتجاوز توقعات عملائنا.\r\n\r\nتعمل شركة Progress Constructions بشكل وثيق مع المهندس المعماري والمهندسين لضمان جودة المشروع من خلال إعداد ميزانيات المشروع التفصيلية والشاملة وجداول البناء. `', 'Progress Constructions is committed to surpassing the expectations of our clients, subcontractors and suppliers; by surpass expectations performance through integrity, professionalism, and service which yields the highest quality construction projects.\r\n\r\nProgress Constructions team is made up of over-achievers who see to it that our customers receive the very best.\r\n\r\nProgress Constructions believe that quality individuals producing quality projects. Excellence is our goal as well as our obligation to our clients. From pre-construction services through project completion, Progress Constructions is committed to exceeding our clients\' expectations.\r\n\r\nProgress Constructions works closely with the Architect and Engineers to ensure a quality project through the preparation of detailed and comprehensive project budgets and construction schedules. `', 'Progress Constructions LLC - دبي - الإمارات العربية المتحدة', '25.1162259', '55.3902387', 1215, 0, 1, 0, NULL, '2023-11-10 16:52:52', '2024-09-14 08:54:24'),
(180, 208, 1, 5, 1, 'Okzeela star building materials trading llc', 'Okzeela star building materials trading llc', 'Haji', 'Sales manager', NULL, NULL, NULL, '5F66+PRP - Warsan 3 - Dubai - United Arab Emirates', '25.162065963958376', '55.462074279785156', 0, 1, 0, 0, NULL, '2023-11-13 04:33:10', '2023-11-13 04:36:41'),
(181, 209, 1, 1, 1, 'arkiplan consulting architects & engineers', 'آركيبلان للاستشارات المعمارية والمهندسين', 'Samar', 'Admin', NULL, 'إن مصممي ومتخصصي الاستشارة في Arkiplan عبارة عن ممارسة هيكلية وتصميمية مع مزيج فريد من الطاقة والخبرة. أحد أفراد تجمع مؤسسات RKM تحت رعاية صاحب السمو الشيخ راشد بن خليفة آل مكتوم، الناقلون الخفيفون للشركة هما خبيران يتمتعان بخبرة استثنائية في مجالاتهما المنفصلة في الشرق الأوسط', 'Arkiplan counseling designers and specialists is a structural and designing practice with a one of a kind mix of energy and experience. An individual from the RKM gathering of organizations under the sponsorship of his Highness Sheik Rashid Bin Khalifa Al Maktoum, the light carriers of the firm are two exceptionally experienced experts in their separate fields in the Middle East', 'ARKIPLAN CONSULTING ARCHITECTS & ENGINEERS - دبي - الإمارات العربية المتحدة', '25.2216803', '55.28100370000001', 1653, 0, 1, 0, NULL, '2023-11-13 19:02:57', '2024-09-13 21:32:04'),
(182, 210, 1, 2, 1, 'Al Shafar National Contracting L.L.C', 'الشعفار الوطنية للمقاولات', 'Samar', 'Admin', NULL, 'الشعفار الوطنية للمقاولات ذ. (SNC) هي عضو في مجموعة الشعفار. تأسست الشركة من قبل السيد أحمد سيف الشعفار في عام 1998 ومنذ ذلك الحين ، نمت شركة SNC وأصبحت الآن واحدة من الشركات المصنفة غير المحدودة في دبي.\r\n\r\nكسياسة إستراتيجية للشركة ، تم إنشاء مجموعة من الشركات (كل شركة بإدارتها المستقلة ولكن جميعها مملوكة لشركة SNC) من أجل تقديم خدمات متكاملة من قبل الشركة في الأعمال الرئيسية والمقاولة من الباطن مثل خدمات الهندسة الكهربائية والميكانيكية والأعمال المعدنية ، بالإضافة إلى الأعمال المدنية والتشطيبات المتخصصة', 'Al Shafar National Contracting LLC. (SNC) is a member of Al Shafar Group. The company was founded by Mr. Ahmed Saif Al Shafar in 1998 and since then, SNC has grown and is now one of the leading unlimited companies in Dubai.\r\n\r\nAs a strategic policy of the company, a group of companies was established (each company with its own independent management but all owned by SNC) in order to provide integrated services by the company in main and subcontracting works such as electrical, mechanical and metalwork engineering services, in addition to civil works and specialized finishes.', 'Al Shafar National Contracting - Dubai - دبي - الإمارات العربية المتحدة', '25.1334047', '55.2347827', 2115, 0, 1, 0, NULL, '2023-11-13 19:14:40', '2024-09-14 14:05:46'),
(183, 211, 1, 2, 1, 'AL MASHRIQ ARCHITECTURAL CONSTRUCTION CO.(L.L.C.)', 'شركة المشرق للانشاءات المعمارية', 'Samar', 'Admin', NULL, 'تعمل شركه (شركة المشرق للانشاءات المعمارية (ش.ذ.م.م فى – مقاولات البناء – اعمال تركيب المعدات الكهروميكانيكيه وصيانتها', 'Al-Mashreq Architectural Construction Company (LLC) works in - building contracting - electromechanical equipment installation and maintenance work.', 'AL MASHRIQ ARCHITECTURAL CONSTRUCTION CO.(L.L.C.) - دبي - الإمارات العربية المتحدة', '25.14466089999999', '55.2344842', 1416, 0, 1, 0, NULL, '2023-11-13 19:31:18', '2024-09-14 14:05:45'),
(184, 212, 1, 2, 1, 'ALHAZAMI BUILDING CONTRACTING (L.L.C)', 'الحزامي لمقاولات البناء (ش.ذ.م.م)', 'Samar', 'Admin', NULL, NULL, NULL, 'Al Hazami Building Contracting - دبي - الإمارات العربية المتحدة', '25.2899429', '55.392947', 3531, 0, 1, 0, NULL, '2023-11-14 12:33:51', '2024-09-14 14:05:46');
INSERT INTO `companies` (`id`, `user_id`, `package_id`, `section_id`, `city_id`, `name_en`, `name_ar`, `responsible_name`, `position`, `license`, `bio_ar`, `bio_en`, `address`, `lat`, `lng`, `views`, `register_by`, `status`, `featured`, `deleted_at`, `created_at`, `updated_at`) VALUES
(185, 213, 1, 1, 1, 'Arenco Architectural & Engineering Consultants', 'ارينكو للاستشارات المعمارية والهندسية', 'Samar', 'Admin', NULL, '\"لقد اكتسبت ARENCO سمعة ممتازة فيما يتعلق بالجودة وخدمة العملاء وستستمر في تحسين خدمات ما بعد البيع لتتجاوز توقعات العميل؛ لأن استئجار عقار هو أبعد من مجرد توقيع العقد. وباعتبارنا علامة تجارية محلية راسخة، فإننا ملتزمون بتقديم التميز في جميع جوانبه للمستخدم النهائي، وهي سمة رئيسية لدبي، فضلاً عن أنها تعكس رؤية القيادة للمستقبل.تأسست شركة أرينكو للاستشارات المعمارية والهندسية في عام 1971 على يد السيد عبد الله أحمد الموسى.', '“ARENCO has established an excellent reputation for quality and customer care and will continue to improve its after-sales services to exceed client’s expectations; because renting a property is way beyond a contract signoff. As a local well-established brand, we are committed to delivering excellence in all its aspects to the end-user, a main trait of Dubai, as well as reflecting the leadership’s vision for the future.”Arenco Architectural & Engineering Consultants was founded in 1971 by Mr. Abdulla Ahmed Al Moosa', 'Arenco Abdullah Ahmed Al Moosa Architectural & Engineering Consultants - شارع الشيخ زايد - دبي - الإمارات العربية المتحدة', '25.09135', '55.15908650000001', 1413, 0, 1, 0, NULL, '2023-11-14 12:46:11', '2024-09-13 21:32:05'),
(186, 214, 1, 2, 1, 'AL AHMADIAH INTERNATIONAL CONTRACTING LLC', 'الأحمدية العالمية للمقاولات ذ.م.م', 'Samar', 'Admin', NULL, 'تعمل شركه الاحمدية للمقاولات والتجارة فى – مقاولات البناء.', 'Al-Ahmadiyya Contracting and Trading Company works in building contracting.', 'AL AHMADIAH INTERNATIONAL CONTRACTING LLC - دبي - الإمارات العربية المتحدة', '25.2447038', '55.3123619', 3870, 0, 1, 0, NULL, '2023-11-14 13:08:47', '2024-09-14 14:05:31'),
(187, 215, 1, 1, 1, 'Model Engineering Consultants', 'مودل للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة Model Engineering Consultants في عام 1972. حصل المؤسس الأصلي لهذه الشركة، السيد شيوارام جاجريا، على ترخيص لممارسة استشارات الخدمات المعمارية والهندسية والميكانيكية والكهربائية والسباكة وحصل على الترخيص من بلدية دبي حديثة النشأة. مع النمو الأولي في دبي، نمت الشركة ونفذت مشاريع في المجالات السكنية والتجارية.', 'Model Engineering Consultants was established in 1972. The original founder of this company, Mr. Shewaram Gajjria obtained the license to practice architectural, engineering & MEP services consulting and obtained the license from a very young and newly formed Dubai Municipality. With the initial growth of Dubai, the company grew and carried out projects in residential and commercial spheres.', 'Model Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.2407283', '55.2723922', 393, 0, 1, 0, NULL, '2023-11-14 13:23:31', '2024-09-14 12:53:33'),
(188, 216, 1, 2, 1, 'Al Ashram Contracting L.L.C.', 'الأشرم للمقاولات ذ.م.م', 'Samar', 'Admin', NULL, 'تعد الأشرم للمقاولات من شركات البناء الرائدة في الإمارات العربية المتحدة. على مدار 45 عاماً أسهمنا بصورة فعّالة في مسيرة التنمية التي شهدتها الدولة، وشاركنا في رسم معالم المستقبل المشرق للإمارات.\r\n\r\nمن ناطحات السحاب الشاهقة إلى مشاريع البنية التحتية المتطورة، نمتلك القدرات والخبرة التي تتيح لنا تلبية المتطلبات ومواجهة التحديات التي تواكب مراحل تنفيذ مشاريع البناء المتنوعة من حيث الحجم والنطاق.', 'Al Ashram Contracting is one of the leading construction companies in the United Arab Emirates. Over the course of 45 years, we have contributed effectively to the development process witnessed by the country, and we have participated in shaping the bright future of the Emirates.\r\n\r\nFrom towering skyscrapers to advanced infrastructure projects, we have the capabilities and experience that allow us to meet the requirements and meet the challenges that accompany the implementation phases of construction projects of varying size and scope.', 'Al Ashram Contracting LLC - Labour Camp - 22 St - دبي - الإمارات العربية المتحدة', '25.26755099999999', '55.4284506', 3570, 0, 1, 0, NULL, '2023-11-14 13:30:42', '2024-09-14 14:05:32'),
(189, 217, 1, 1, 1, 'Al Sahil Engineering Consultations', 'الساحل للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة ساحل للاستشارات الهندسية في 11 أغسطس 2011 على يد السيد مكتومصاحب عباس كازي. إنه مهندس معماري ديناميكي وأكمل تخرجه من جامعة بيون المعروفة باسم موطن التعليم. لديها رخصة عمل تصل إلى G+4، حيث نقوم بتنفيذ مشروع مليء بالتحديات يشمل المساجد والمباني السكنية والتجارية والمؤسسات التعليمية والمشاريع العامة والخاصة والمستودعات الصناعية والفيلات الفاخرة والاقتصادية ومساكن العمال.', 'Sahil Engineering Consultants company is established in August 11, 2011 by Mr. Maktumsaheb Abbas Kazi. He is dynamic Architect and completed his graduation from Pune University which is known as Home of Education. It has working license of up to G+4, in which we undertake challenging project that includes Mosque, Residential and Commercial Buildings, Educational Institutions, Public and Private Projects, Industrial Warehouses, Luxurious and Economical villas and Labour Camps.', 'Sahil Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.27844559999999', '55.3859612', 0, 0, 0, 0, NULL, '2023-11-14 13:40:30', '2023-11-14 13:44:03'),
(190, 218, 1, 2, 5, 'sundus Building Contracting', 'سندس لمقاولات البناء', 'Samar', 'Admin', NULL, 'Sundus Building Cont. (L. L. C.) شركة عالمية رائدة في مجال الهندسة والبناء المقاول مع البصمة التي تغطي الشرق الأوسط وأفريقيا إنجلترا للعملاء من القطاعين العام والخاص قمنا بتنفيذ العديد من l arge المشاريع المعقدة التي من خلالها قمنا بتطوير مجموعة واسعة.', 'Sundus Building Cont. (L.L.C.) is a leading global engineering and construction contractor with a footprint spanning the Middle East, Africa and England for public and private sector clients. We have undertaken many l arge complex projects through which we have developed a wide portfolio.', 'سندس لمقاولات البناء Sundus Building CONT. L.L.C - شارع الشيخ خليفة بن زايد - near Ajman Stadium - عجمان - الإمارات العربية المتحدة', '25.390752', '55.4510173', 399, 0, 1, 0, NULL, '2023-11-14 13:56:16', '2024-09-13 09:37:53'),
(191, 219, 1, 1, 5, 'Design Engineering Consultants', 'ديزاين للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'هل أنت بحاجة إلى حلول هندسية متخصصة في التصميم لشركتك؟ لا مزيد من البحث!\r\n\r\nمرحبًا بك في شركة ديزاين للاستشارات الهندسية، شريكك الموثوق به في عجمان لجميع احتياجاتك التصميمية والهندسية. بفضل سنوات خبرتنا وفريقنا من المهنيين ذوي المهارات العالية، نقدم خدمات استشارية من الدرجة الأولى مصممة خصيصًا لتلبية متطلباتك الفريدة.\r\n\r\nفي شركة ديزاين للاستشارات الهندسية، ندرك أهمية التصميم الفعال في تحقيق النجاح. سواء كنت بحاجة إلى مساعدة في التصاميم المعمارية، أو الهندسة الإنشائية، أو مشاريع الهندسة المدنية، فإن فريقنا المتخصص موجود هنا لتقديم حلول مبتكرة تتجاوز التوقعات.', 'Are you in need of expert design engineering solutions for your business? Look no further!\r\n\r\nWelcome to Design Engineering Consultants, your trusted partner in Ajman for all your design and engineering needs. With our years of experience and a team of highly skilled professionals, we offer top-notch consultancy services tailored to meet your unique requirements.\r\n\r\nAt Design Engineering Consultants, we understand the importance of effective design in achieving success. Whether you need assistance with architectural designs, structural engineering, or civil engineering projects, our dedicated team is here to provide innovative solutions that exceed expectations.', 'DESIGN ENGINEERING CONSULTANTS - شارع بدر - عجمان - الإمارات العربية المتحدة', '25.3936152', '55.4401682', 396, 0, 1, 0, NULL, '2023-11-16 12:59:30', '2024-09-14 14:08:15'),
(192, 220, 1, 2, 5, 'Sarh Al Murjan Building Contracting', 'صرح المرجان لمقاولات البناء', 'Samar', 'Admin', NULL, 'صرح المرجان لمقاولات البناء ذ.م.م شركة رائدة في مقاولات البناء حيث كان تأسيس الشركة لنا بسنة 2019 وبدأنابمجال المقاولات منذ ذلك الوقت وعلماً بأن في الشركة خبرات في الامور المتعلقة في مجال مقاولات البناء لأكثر من 17 سنة واكثرا', 'l Murjan Building Contracting LLC is a leading company in building contracting, as our company was established in the year 2019 and we started in the field of contracting since that time, knowing that the company has experience in matters related to the field of building contracting for more than 17 years and more.', 'Sarh Al Murjan Building Contracting L.L.C - عجمان - الإمارات العربية المتحدة', '25.38762939999999', '55.4631561', 540, 0, 1, 0, NULL, '2023-11-16 13:10:26', '2024-09-13 23:56:02'),
(193, 221, 1, 1, 5, 'Continental Engineering Consultant', 'المكتب القاري للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'CEC هي شركة من المصممين والمهندسين والمخططين والاستشاريين تقدم مجموعة متنوعة من المهن', 'CEC is a firm of designers, engineers, planners and consultants providing a diverse range of profess', 'Continental Engineering Consultant - شارع الشيخ راشد بن حميد - عجمان - الإمارات العربية المتحدة', '25.4028493', '55.4402743', 432, 0, 1, 0, NULL, '2023-11-16 13:26:27', '2024-09-13 17:40:35'),
(194, 222, 1, 2, 19, 'Prestige Constructions LLC', 'برستيج للإنشاءات ذ.م.م', 'Samar', 'Admin', NULL, 'على مر السنين، نمت شركة برستيج للإنشاءات من قوة إلى قوة، حيث قامت بوضع كل لبنة بأخلاقيات وأخلاق قوية. لقد كان التطوير متعدد الأوجه ومتنوعًا بشكل غني عبر القطاعات السكنية والتجارية والتجزئة والتعليم والرعاية الصحية والصناعية. إن ما نقوم به يتحدث كثيرًا عما نعلنه. إن المجموعة المتنوعة من المشاريع التي أنجزناها حتى الآن تشبع شغفنا بالتفكير فيما وراء التقاليد وتحقيق أي حلم إلى تجربة ملموسة فورية. نحن معروفون جيدًا كمتخصصين في استخدام التكنولوجيا الرائدة في السوق الذي نعمل فيه.', 'Over the years, Prestige Constructions has grown from strength to strength, laying each brick with strong ethics and morals. The development has been multi-faceted and richly diversified across the verticals of Residential, Commercial & Retail, Educational & Healthcare and Industrial. What we do speaks volumes more than what we profess. The multifarious range of projects we have accomplished till now imbibe our passion to think beyond conventions and actualize any dream into an immediate tangible experience. We are well recognized as a specialist in utilizing avant – garde technology in the market we operate.', 'Prestige Constructions LLC, Ajman, the Black Square - First Floor - عجمان - الإمارات العربية المتحدة', '25.3892077', '55.4624763', 471, 0, 1, 0, NULL, '2023-11-16 13:42:27', '2024-09-14 14:01:08'),
(195, 223, 1, 1, 1, 'EDMAC Engineering Consultant', 'إيدماك للإستشارات الهندسية', 'Samar', 'Admin', NULL, 'EDMAC (مهندس التصميم والإدارة والهندسة المعمارية والمدنية) هو فريق متحمس للغاية ومُدار بكفاءة من المهندسين والمهندسين المعماريين والمخططين الذين عملوا في العديد من المشاريع الصعبة في جميع أنحاء الإمارات العربية المتحدة.', 'EDMAC (Engineer for Design, Management, Architectural and Civil) is a highly motivated and efficiently managed team of engineers, architects and planners that have worked on many challenging projects across UAE.', 'Edmac Engineering Consultant - دبي - الإمارات العربية المتحدة', '25.1838361', '55.26088180000001', 1413, 0, 1, 0, NULL, '2023-11-16 14:32:10', '2024-09-14 12:28:31'),
(196, 224, 1, 2, 20, 'TEAM ENGINEERING ENTERPRISES LTD.', 'تيم للمشاريع الهندسية المحدودة', 'Samar', 'Admin', NULL, 'تأسست شركة تيم الهندسية للمشاريع المحدودة، وهي كيان ذو مسؤولية محدودة، في يوليو 1982 في إمارة الشارقة، الإمارات العربية المتحدة. كشركة مقاولات في مجال البناء الصناعي والتجاري. لم تدخر شركة Team Engineering، منذ إنشائها، أي جهد في سعيها لتحقيق الجودة. تسعى شركة Team Engineering جاهدة لمواكبة أحدث التطورات والابتكارات في مجال البناء وتتبنى دائمًا أحدث التقنيات المتاحة.', 'TEAM Engineering Enterprises Limited, a Limited Liability Entity, was established in July 1982 at Emirate of Sharjah, U.A.E. as a Contracting Company in the field of industrial and commercial construction.  Team Engineering, since its inception, left no stone unturned in its quest for quality. Team Engineering strives to keep abreast of the latest developments and innovations in the field of construction and has always embraced the latest available technologies.', 'Team Engineering Enterprise LTD - شارع السمر - off شارع الشيخ محمد بن زايد - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.2940389', '55.4352133', 519, 0, 1, 0, NULL, '2023-11-20 04:51:05', '2024-09-13 17:47:50'),
(197, 225, 1, 2, 1, 'skr building contracting llc', 'اس كي آر لمقاولات البناء', 'Samar', 'Admin', NULL, 'تعمل شركة SKR BUILDING CONTRACTING LLC بشكل حيوي في مجال البناء والتشييد. لدينا خبرة في تنفيذ العديد من المشاريع مثل المباني السكنية والتجارية متعددة الطوابق والأبراج والمساجد والفلل والمعارض والمستودعات والسقائف ومباني البناء الأخرى.', 'SKR BUILDING CONTRACTING LLC is dynamically engaged in the field of Building and construction. We are having experience of executing several projects such as Residential & Commercial Multi Storey Building, Towers, Mosques, Villas, Showrooms, Warehouses, Sheds, and other construction buildings.', 'SKR BUILDING CONTRACTING L.L.C. - شارع الرقة - دبي - الإمارات العربية المتحدة', '25.2625023', '55.3264364', 1275, 0, 1, 0, NULL, '2023-11-20 05:02:18', '2024-09-14 08:54:24'),
(198, 226, 1, 1, 1, 'NA Architects Engineering Consultancy', 'NA معماريون للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'يعتقد NA Architects أن عملية التصميم هي التحرك بقصد سد الفجوة بين الظروف الحالية والرؤية الأصلية. سواء كان ذلك داخليًا أو معماريًا، فإن التصميم الجيد هو عملية مستمرة من القرارات والاستراتيجيات التي تتيح الابتكار وإنشاء بيئات تعزز الأداء الوظيفي ونوعية الحياة. لدينا فريق متخصص من المهندسين المعماريين الموهوبين يضعون في أذهانهم تحقيق أفضل النتائج.', 'NA Architects believes that the act of designing is to move with intent to close the gap between existing conditions and the original vision. Be it Interior or Architecture, Good Design is an ongoing process of decisions and strategies that enable innovation and create environments that enhance functionality and quality of life. Our dedicated team of talented Architects put in their minds to create the best outcomes.', 'NA Architects Engineering Consultancy - Al Mustaqbal Street - دبي - الإمارات العربية المتحدة', '25.1862779', '55.2600702', 1692, 0, 1, 0, NULL, '2023-11-20 05:16:37', '2024-09-14 13:53:32'),
(199, 227, 1, 1, 20, 'Emirates Engineer Consulting Engineering', 'المهندس الاماراتي للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'يسعى مهندس الإمارات إلى تقديم تصميم جمالي فريد يستخدم التصميم والمواد في مجال cr', 'Emirates Engineer seeks to deliver a unique design aesthetic that employs design and materials in cr', 'Emirates Engineer Consulting Engineering - شارع عبدالسلام عارف - الشارقة - الإمارات العربية المتحدة', '25.316897', '55.38145000000001', 408, 0, 1, 0, NULL, '2023-11-20 05:31:30', '2024-09-13 23:19:38'),
(200, 228, 1, 2, 1, 'Al Sayegh Contracting L.L.C', 'الصايغ للمقاولات ذ.م.م', 'Samar', 'Admin', NULL, 'تقع دولة الإمارات العربية المتحدة على مفترق الطرق بين الشرق الأوسط وأفريقيا وجنوب آسيا. إنها بيئة تجارية وتجزئة نابضة بالحياة، وتقدم أنماط حياة رائعة مع ثقافة محلية مميزة. وهذا هو المكان الذي يتم فيه تقديم العلامات التجارية الرائدة للمستهلكين المميزين في المنطقة.\r\n\r\nتأسست مجموعة الصايغ في عام 1980 على يد عبد الجبار الصايغ، وهي عبارة عن تكتل في دولة الإمارات العربية المتحدة، في مجالات الإلكترونيات وقطاع الطاقة والتموين والتعليم ومراكز اللغات وحلول المطبخ وخدمات التوظيف وهندسة السيارات ودور الصرافة.\r\n\r\nيكمن إيماننا القوي في شركائنا الملتزمين وعملائنا المخلصين والموظفين المتفانين وشبكة البيع بالتجزئة الواسعة لضمان استمرار المنتجات ذات المستوى العالمي في دعم الاحتياجات المتزايدة لدولة الإمارات العربية المتحدة.', 'he United Arab Emirates (UAE) is at the crossroads of the Middle East, Africa and South Asia. It is a vibrant trading and retail environment, offering superlative lifestyles with a distinctive local culture. This is where leading brands are presented to the region’s discerning consumers.\r\n\r\nEstablished in 1980 by Abdul Jabbar Al Sayegh, Al Sayegh Group has been a conglomerate in the UAE, in the fields of Electronics, Energy sector, Catering, Education, Language Centers, Kitchen Solutions, Recruitment Services, Auto Engineering & Exchange Houses.\r\n\r\nOur strong belief lies in our committed partners, loyal customers, dedicated staff and a vast retail network to ensure that world-class products continue to support the growing needs of the UAE.', 'Al Sayegh Contracting LLC / Al Sayegh Engineering Est. - دبي - الإمارات العربية المتحدة', '25.18453460000001', '55.2601257', 4044, 0, 1, 0, NULL, '2023-11-20 05:40:49', '2024-09-14 14:24:05'),
(201, 229, 1, 1, 1, 'Proline Engineering Consultants', 'برولاين للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة برولاين للاستشارات الهندسية في عام 2006 في دبي، الإمارات العربية المتحدة وتعمل حاليًا في قطاعين مترابطين، خدمات البناء والتطوير العقاري بهدف واحد هو أن نكون المكتب الاستشاري الأول في دبي، الإمارات العربية المتحدة.\r\n\r\nبقيادة رئيس مجلس الإدارة المؤسس وصاحب الشركة المهندس. السيد عبد الحليم، نمت الأعمال بقوة على مدى السنوات الأربع عشرة الماضية لتغطية تشييد المباني والبنية التحتية.\r\n\r\nتتألف شركة برولاين للاستشارات الهندسية من موظفين ذوي خبرة جيدة ومؤهلين تأهيلاً عاليًا يتمتعون بسنوات عديدة من الخبرة المحلية والدولية والمشاركة في أعمال المقاولات، وهم ملتزمون بشدة ببذل كل الوسائل والموارد من أجل تحقيق رؤية الشركة للتميز كقائد وأن تكون مستشارًا موثوقًا به. في البناء والصناعة في الشرق الأوسط”.', 'PROLINE ENGINEERING CONSULTANTS was established on 2006 in Dubai, United Arab Emirates and currently operates in two interlinked sectors, construction services and property development with one goal to achieve is to be the number one consultant office in Dubai, UAE.\r\n\r\nLed by its founder chairman and company owner, Eng. El Sayed Abdelhalim, the business has grown strongly over the last fourteen years to cover building and infrastructure construction.\r\n\r\nPROLINE ENGINEERING CONSULTANTS comprises of well experienced and highly qualified staff with many years of local and international exposure and involvement in the contracting business who are firmly committed to exert all means and resources in order to fulfill company’s vision to excel as leader and be a credible consultant in the Middle East’s construction and industry”.', 'Proline Engineering Consultants - شارع زعبيل - دبي - الإمارات العربية المتحدة', '25.242301', '55.3071103', 507, 0, 1, 0, NULL, '2023-11-23 06:19:00', '2024-09-14 10:10:55'),
(202, 230, 1, 2, 1, 'Nantong Construction Group Company Limited', 'شركة مجموعة نانتونغ للإنشاءات المحدودة', 'Samar', 'Admin', NULL, 'NaN tong Construction Group co., Ltd. شركة إنشاءات ISA مقرها رقم 136 D UA NJ i ABA road, C hong chu an District, NaN tong, Jiangsu, NaN tong, الصين.', 'Nantong Construction Group Co., Ltd. is a construction company based out of NO.136 DUANJIABA ROAD, CHONGCHUAN DISTRICT, NANTONG, JIANGSU, Nantong, China.', 'Nantong Construction Group Company Limited', NULL, NULL, 4995, 0, 1, 0, NULL, '2023-11-23 06:31:23', '2024-09-13 23:34:29'),
(203, 231, 1, 1, 1, 'noora engineering consultant', 'نورا للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'الخبرة الهندسية هي جوهر كل ما نقوم به. توفر فرقنا مجموعة كاملة من الخدمات الهندسية بما في ذلك الهندسة المعمارية والهيكلية والميكانيكية والكهربائية والسباكة والمناظر الطبيعية والتخطيط الحضري. نقوم أيضًا بتنفيذ أعمال الإشراف على الموقع وإدارة المشاريع لتسليم المنشآت سليمة وفي الوقت المحدد.\r\n\r\nتشمل خدماتنا أيضًا دور \"مهندس السجل\"، والذي قمنا به بنجاح للعديد من المشاريع ونعزو إكمالها بفعالية إلى خبرتنا العميقة مع الهيئات التنظيمية وهيئات الموافقة.\r\n\r\nلدينا سجل مهارات لتصميم المشاريع التي تتراوح بين المباني الشاهقة السكنية والتجارية والضيافة والاستخدام المختلط والتعليمية والرعاية الصحية والعامة والحكومية.', 'Engineering expertise is at the heart of everything we do. Our teams provide a full suite of engineering services including Architecture, Structure, MEP, landscape and Urban Planning. We further perform site supervision work and project management to deliver establishments intact and on time.\r\n\r\nOur services also include the “architect of record” role, which we have performed successfully for several projects and attribute their effective completion to our profound experience with regulatory and approval bodies.\r\n\r\nWe have the skill record for designing projects ranging from High Rise Buildings Residential, Commercial, Hospitality, Mixed use, Educational, Health care, Public & Governmental.', 'Noora Engineering Consultancy - دبي - الإمارات العربية المتحدة', '25.2198392', '55.32333999999999', 5142, 0, 1, 0, NULL, '2023-11-23 06:49:55', '2024-09-14 08:14:38'),
(204, 232, 1, 2, 1, 'ABNA ALAMIR COUNTRACTING L.L.C', 'ابناء الامير للمقاولات ش.ذ.م.م', 'Samar', 'Admin', NULL, 'تأسست مجموعة حسن الأمير عام 1992 وسميت باسم لوزان للمقاولات، ومع مرور الوقت تغير كل شيء، وكذلك اسم الشركة وتسميتها أبناء الأمير للمقاولات. منذ البداية المتواضعة، نمت شركة ابناء الأمير للمقاولات على قدم وساق، لمواكبة النمو المذهل في دولة الإمارات العربية المتحدة. الآن، تطورنا إلى سبع شركات، وهي: أبناء الأمير للمقاولات ذ.م.م، حسن الأمير للأعمال الكهروميكانيكية ذ.م.م، حسن الأمير للتجارة ذ.م.م، حسن الأمير للعقارات ذ.م.م، حسن الأمير لتحليل التربة ذ.م.م، جواهر للتصميم الداخلي ذ.م.م. الرواد لصناعة الألمنيوم والأخشاب ذ.م.م، والتي كانت تابعة لمجموعة شركات حسن الأمير، لدينا كل الشركات اللازمة لبناء فلل ومباني رائعة، من تحليل التربة والبناء إلى التأثيث. لقد تعلمنا التكيف مع احتياجات السوق الصعبة والتنويع في مثل هذه القطاعات المتنوعة، كل ذلك خلال فترة قصيرة من الزمن.\r\n\r\nلقد كانت رحلة صعبة للغاية منذ بداية شركتنا في عام 1992 وحتى اليوم. بعد أن بدأنا كشركة عائلية صغيرة، أصبحنا الآن مجموعة من الشركات. التحدي الرئيسي الذي يواجهنا اليوم هو الحفاظ على النمو الذي حققناه حتى الآن. نحن فخورون بماضينا ولدينا حاضر فاعل ونتطلع إلى مستقبل واعد.', 'The Hassan al amir group was established in 1992 and named as Luzan contracting, and as time goes by, everything had changed, as well as the company name, and name it as Abna al amir contracting. From humble beginning, Abna Al amir contracting have grown by leaps and bounds, keeping pace with the amazing growth of the Emirates. Now, we have grown into seven company, namely, Abna Al Amir contracting LLC, Hassan Al Amir Electromechanical works LLC, Hassan Al amir trading LLC, Hassan al amir Real Estate LLC, Hassan al amir soil analysis LLC, Jewels interior design, LLC and Al Ruwad aluminum and wood industry LLC ,that were under Hassan al amir group of companies, we have all the necessary company needed in building exquisite villas and buildings, from soil analysis, construction to furnishing. We have learned to adapt to the demanding market needs and diversified into such varied sectors, all within such a short period of time.\r\n\r\nIt has been a very challenging journey from the start of our company in 1992 until today. Having started as a small family business, we are now group of companies. Our major challenge today is to sustain the growth we generated till date. We are proud of our past and we have an active present and we look forward to a promising future.', 'Hassan Al Amir Group of Companies, مجموعه حسن الامير - دبي - الإمارات العربية المتحدة', '25.1229996', '55.22464549999999', 5832, 0, 1, 0, NULL, '2023-11-30 04:45:00', '2024-09-14 14:05:31'),
(205, 233, 1, 2, 1, 'Al Ummah Contracting LLC', 'الامة للمقاولات ذ.م.م', 'Samar', 'Admin', NULL, 'يسر الشركة أن تقدم أنفسنا كـ M/s. الأمة للمقاولات شركة ذات مسؤولية محدودة شركة في دبي، الإمارات العربية المتحدة. تأسست الشركة في عام 1990 لتشييد المباني G+4 وقمنا بتنفيذ العديد من المشاريع في دبي وما حولها. وفي عام 2003 حصلت على رخصة بناء عمارات أرضي + 7 طوابق وفي عام 2005 حصلت على رخصة بناء أرضي + 12 طابقا. لقد أنجزت الشركة العديد من المشاريع بما ينال رضا أصحابها إلى أقصى حد. تحت القيادة الديناميكية لشريك شركتنا المهندس بديع سليم واصف، تحرز شركتنا تقدمًا يومًا بعد يوم.', 'The firm takes great pleasure to introduce ourselves as M/s. Al Ummah Contracting an established L.L.C. company in Dubai, United Arab Emirates. The company was established in the year 1990 for the construction of G+4 buildings and we have executed several projects in and around Dubai. In the year 2003 it got the licence for constructing Ground + 7 store buildings and in 2005 it received the licence for constructing ground + 12 floors. The company has completed many projects to the utmost satisfaction of the owners. Under the dynamic leadership of our company partner Engineer Badea Selim Wasef, our company is making progress day by day.', 'Al Ummah Contracting LLC - Trade Center St - دبي - الإمارات العربية المتحدة', '25.221958', '55.28125', 5937, 0, 1, 0, NULL, '2023-11-30 05:08:29', '2024-09-14 14:05:46'),
(206, 234, 1, 2, 1, 'Julfar Contracting LLC', 'جلفار للمقاولات ذ.م.م', 'Samar', 'Admin', NULL, 'جلفار لمقاولات البناء (JBC) هي اسم رائد في صناعة البناء والتشييد في منطقة الشرق الأوسط', 'Julfar Building Contracting (JBC) is a leading name in the construction industry within the Middle E', 'Julfar contracting - 28 B St - دبي - الإمارات العربية المتحدة', '25.2321849', '55.55561549999999', 5271, 0, 1, 0, NULL, '2023-11-30 05:24:35', '2024-09-13 15:49:04'),
(207, 235, 1, 2, 2, 'AL RAKHA GENERAL CONTRACTING (L.L.C)', 'الرخاء للمقاولات العامة ش.ذ.م.م', 'Samar', 'Admin', NULL, 'مجموعة الرخاء\r\nنحن إحدى الشركات الخاصة الواعدة والمتوسعة بشكل كبير في دولة الإمارات العربية المتحدة.\r\n\r\nتتطور مجموعة شركات الرخاء بسرعة باعتبارها واحدة من الشركات الرائدة في دولة الإمارات العربية المتحدة. تأسست الشركة في عام 1986 تحت اسم شركة الرخاء للمقاولات العامة ذ.م.م، وحققت الشركة نجاحًا كبيرًا وسرعان ما أضافت أربع شركات أخرى إلى جعبتها، لتصبح مجموعة شركات.', 'Al Rakha Group\r\nWe are one of the most promising and exponentially expanding privately owned companies in the UAE.\r\n\r\nAl Rakha Group of Companies is rapidly evolving as one of the frontrunner companies in UAE. Established in 1986 as Al Rakha General Contracting Company WLL, the company zoomed to success and soon added four more companies to its quiver, becoming a conglomerate.', 'AL RAKHA GENERAL CONTRACTING (L.L.C) - Khalidiyah Street - أبو ظبي - الإمارات العربية المتحدة', '24.4737711', '54.3490283', 5886, 0, 1, 0, NULL, '2023-11-30 05:37:17', '2024-09-14 14:05:45'),
