(213, 247, 1, 1, 1, 'Al Maali Engineering Consultancy', 'المعالى للاستشارات الهندسة', 'Samar', 'Admin', NULL, 'تأسست شركة المعالي للاستشارات الهندسية في عام 2009، وهي شركة استشارية مقرها الهند والإمارات العربية المتحدة. نحن متخصصون في المشاريع التجارية والصناعية والسكنية.\r\nنقدم لك أحدث التقنيات للتعامل مع الاستشارات الهندسية وتقنيات البناء المتغيرة بسرعة؛ تقدم شركة المعالي للاستشارات الهندسية للعملاء المعرفة الصناعية العميقة والخبرة الاستشارية. من خلال الموظفين والزملاء المهرة، تقدم شركة المعالي للاستشارات الهندسية وتساعد العملاء على تلبية متطلباتهم بأقصى قدر من الإبداع ومعايير الجودة العالية', 'Founded in 2009, Al Maali Engineering Consultancy is an India and UAE based consultancy Company.  We Specialize in commercial, industrial and residential projects.\r\nWe Bring you the latest Technologies Coping with the rapidly changing engineering consultancy and construction technologies; Almaali Engineering Consultancy is providing the clients with deep industrial knowledge and consultancy expertise. Through the top skilled staff and associates, Almaali Engineering Consultancy provides and helps the clients to deliver their requirements up to the maximum of creativity and top quality standards', 'Al Maali Engineering Consultancy (المعالي الاستشارات الهندسية) - Muscat Road - دبي - الإمارات العربية المتحدة', '25.1723258', '55.2601255', 573, 0, 1, 0, NULL, '2024-08-19 11:53:49', '2024-09-14 14:05:40'),
(214, 248, 1, 2, 1, 'EMIRATES SANDS Contracting Co LLC', 'رمال الامارات للمقاولات', 'Samar', 'Admin', NULL, 'تأسست شركة ESC في عام 1994، ويقع مقر المجموعة الرئيسي في دبي، الإمارات العربية المتحدة. نمت شركة ESC وتطورت على مدى العقدين الماضيين، لتصبح شركة إنشاءات رائدة في تنفيذ مشاريع خاصة متكاملة في الإمارات العربية المتحدة. توظف شركة ESC أكثر من 350 موظفًا في قوتها العاملة.', 'ESC founded in 1994, the group’s headquarters is in Dubai, UAE. ESC has grown and developed over the last two decades, to become an industry leading construction company for the execution of turnkey special projects in the UAE. ESC employs more than 350+ personnel in its workforce.', 'SANDS CONTRACTING CO. (L.L.C) - 2nd Floor - دبي - الإمارات العربية المتحدة', '25.2507138', '55.3407582', 189, 0, 1, 0, NULL, '2024-08-19 12:06:25', '2024-09-14 13:51:21'),
(215, 249, 1, 1, 3, 'Bait Al Imarah Engineering Consultancy', 'بيت العمارة للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'بيت العمارة للاستشارات الهندسية هي إحدى شركات الاستشارات المعمارية والهندسية في الشارقة. تتمتع الشركة بسمعة طيبة لمدة 27 عامًا في التميز في التصميم. تقديم خدمات التخطيط والتصميم والإدارة الهندسية المتكاملة.', 'Bait Al Amara Engineering Consultants is one of the leading architectural and engineering consulting firms in Sharjah. The company has a 27-year reputation for excellence in design. Providing integrated planning, design and engineering management services.', 'Bait Al Imarah Engineering Consultancy - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.3292023', '55.3917153', 198, 0, 1, 0, NULL, '2024-08-19 12:28:46', '2024-09-12 20:35:43'),
(216, 250, 1, 2, 5, 'Cochin Building Contracting L.L.C', 'كوتشين للمقاولات البناء', 'Samar', 'Admin', NULL, 'تأسست شركة كوتشين للمقاولات في عام 2009، كمنظمة ذات إدارة احترافية. تعد شركة كوتشين للمقاولات واحدة من أفضل شركات المقاولات تطوراً وتحديثاً في إمارة عجمان، الإمارات العربية المتحدة. نحن نتعهد بتنفيذ جميع أنواع البناء.', 'Cochin Building Contracting LLC (CBC) was established in the year 2009, as a professionally managed organization. CBC is one of the best-developed and modernized contracting company in the emirates of Ajman, UAE. We undertake all types of construction.', 'Cochin Building Contracting L.L.C - Shaikh Rashid Bin Abdul Aziz Aaemi St - عجمان - الإمارات العربية المتحدة', '25.4106472', '55.44334929999999', 234, 0, 1, 0, NULL, '2024-08-19 12:39:25', '2024-09-13 16:38:38'),
