(218, 252, 1, 2, 1, 'City Nights Contracting LLC', 'ليالي المدينة للمقاولات (ش.ذ.م.م)', 'Samar', 'Admin', NULL, NULL, NULL, 'City Nights Contracting LLC - دبي - الإمارات العربية المتحدة', '24.985669', '55.1467645', 0, 0, 0, 0, '2024-08-21 01:35:40', '2024-08-21 01:34:15', '2024-08-21 01:35:40'),
(219, 253, 1, 2, 1, 'Union Contracting Company', 'شركة يونيون للمقاولات', 'Samar', 'Admin', NULL, 'ركة الاتحاد للمقاولات ذ.م.م. هي شركة إنشاءات رائدة تعمل من المكتب الرئيسي في دبي ولديها عمليات في أبو ظبي والمملكة العربية السعودية. تشارك شركة الاتحاد للمقاولات في أعمال البناء المدني. تم تعزيز شركتنا بمحترفين ذوي خبرة في صناعة البناء. يتكون فريق الموارد البشرية لدينا من موظفين فنيين وغير فنيين ذوي خبرة وعمال مهرة وشبه مهرة. نحن نعتمد على أنفسنا بأسطولنا الخاص من آلات ومعدات البناء. ميزاتنا البارزة تجعلنا مفضلين في السوق.', 'Union Contracting Co. LLC. is a leading construction company operating from Dubai head office and having operations in Abu Dhabi and Saudi Arabia. Union Contracting Co. is involved into Building civil construction works. Our Company is strengthened with experienced professional in the construction industry. Our human resource pool has experienced technical, non-technical personnel, skilled and semi-skilled workers. We are self reliant with our own fleet of construction machineries and equipments. Our salient features keeps us preferred in the market.', 'Union Contracting Co - دبي - الإمارات العربية المتحدة', '24.9676478', '55.2046235', 150, 0, 1, 0, NULL, '2024-08-21 01:41:11', '2024-09-13 22:52:34'),
(220, 254, 1, 2, 20, 'Sarh Al Khaleej Building Contracting LLC', 'صرح الخليج لمقاولات البناء', 'Samar', 'Admin', NULL, 'نحن نفخر بقدرتنا على تزويد عملائنا باستمرار بخيارات تصميم وبناء مبتكرة وعالية الجودة لمشاريع البناء المختلفة.', 'We pride ourselves on our ability to consistently provide our clients with innovative, high-quality design-build options for varying construction projects.', 'Sarh Al khaleej Building Contracting LLC صرح الخليج لمقاولات البناء ذ.م.م - شارع حفيضه إبراهيم - near Grand Mall - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.3544564', '55.3963676', 174, 0, 1, 0, NULL, '2024-08-21 01:58:49', '2024-09-14 13:03:38'),
(221, 255, 1, 2, 1, 'Shine Square Building Contracting llc', 'شاين اسكوير لمقاولات البناء', 'Samar', 'Admin', NULL, 'شركة شاين سكوير للمقاولات. عندما دخلت مجال البناء في الإمارات العربية المتحدة، أدركت أن هناك منافسة شرسة في هذا المجال. وهنا أدركت أنه يتعين عليّ إنشاء شركة تتميز بكونها فريدة من نوعها في المنطقة. ومن أجل تحقيق هذا الحلم، قمت بتكوين فريق رائع من القوى العاملة ذات الخبرة والعمل الجاد، وهذا ما يميز شركة شاين سكوير للمقاولات عن باقي الشركات حيث نقوم بتسليم مشروعنا في أقل مدة ممكنة وبأكثر الطرق فعالية من حيث التكلفة دون المساومة على جودة البناء. وأنا أتأكد من تقديم أفضل خدمة بأفضل طريقة ممكنة لعملائي. ومنذ البداية، نحن ملتزمون تمامًا بتلبية احتياجات عملائنا.', 'Shine Square Building Contracting LLC. When I entered in to the construction field in UAE, I understood that there is tough competition in this field. This is when I realized I had to make a firm which stands unique in the region. In order to fulfill this dream I made a wonderful team of experienced and hardworking workforce because of which SSBC does stand out of the group as we deliver our project at the least duration in most cost effective way without compromising in the quality of the building. I make sure I give the best service in the best possible way to my clients. Right from the inception, we are solely dedicated to catering to the needs of our clients.', 'Shine Square Building Contracting LLC - مراسي درايف - دبي - الإمارات العربية المتحدة', '25.1806679', '55.2676356', 450, 0, 1, 0, NULL, '2024-08-21 02:18:15', '2024-09-14 14:03:17'),
(222, 256, 1, 1, 3, 'AL Nahda Eng. Consultant', 'النهضـــة للإستشارات الهندسية', 'Samar', 'Admin', NULL, 'أصبحت النهضة واحدة من أكثر شركات التصميم المعماري متعدد التخصصات إنجازًا في المنطقة مع محفظة متنوعة تغطي جميع أنواع التطورات', 'AL NAHDA became one of the most accomplished multidisciplinary Architectural Design in the region with a diverse portfolio spanning all types of developments', 'Sharjah - United Arab Emirates', '25.297591', '55.381696', 126, 0, 1, 0, '2024-08-24 16:32:25', '2024-08-22 01:11:02', '2024-08-24 16:32:25'),
(223, 257, 1, 1, 3, 'Al Ajmi Engineering Consultans', 'العجمى للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'حافظت شركة العجمي للاستشارات الهندسية على وجودها في السوق المحلية والعالمية خلال أسوأ فترات الركود الاقتصادي وذلك بفضل سجلها الحافل في تقديم خدمات الاستشارات المهنية، والحرفية الممتازة، والنزاهة، والمبادئ السليمة، والموظفين المؤهلين تأهيلا عاليا، والتواجد في طليعة تبني أحدث التصاميم وتقنيات البناء.', 'Al Ajmi Engineering Consultants sustained its presence in the local and global market throughout the worst economic downturns due to having a reputable track record of providing professional consultancy services, excellent workmanship, integrity, sound principles, highly qualified staff and being at the forefront of adopting the latest designs and construction technique', 'Al Ajmi Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.265229', '55.32124139999999', 522, 0, 1, 0, NULL, '2024-08-22 01:23:59', '2024-09-14 14:05:32'),
(224, 259, 1, 1, 1, 'BHNS Engineering Consultants', 'بي اتش ان اس للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'نحن نعمل نحو أعلى معايير الاحتراف والنزاهة والصدق المباشر. نحن نبذل قصارى جهدنا وأكثر أعمالنا فعالية من حيث التكلفة عندما ينضم إلينا عملاؤنا في تلبية هذه التوقعات. في نهجنا تجاه العمل، نفهم دائمًا وجهة نظر العميل ونجد حلاً وننشئ تجربة تسليم مشروع تتدفق ونخطط ونلتزم ونسلم في الوقت المحدد ونعطي الأولوية للعملاء الذين يعملون معنا عن كثب، وأولئك الذين هم على استعداد لتقدير الفوائد العديدة للمباني الخضراء.', 'We work toward the highest standards of professionalism, integrity and straight forward honesty. We do our best, most cost-effective work when our clients join us in meeting these expectations.In our approach to the business we always Understand the client\'s perspective Find a solution,Create a project delivery experience that flows Plan,commit and deliver on time We give priority to clients who work closely with us, and to those who are ready to appreciate the many benefits of greener buildings.', 'BHNS ENGINEERING CONSULTANTS - Dubai - United Arab Emirates', '25.251901', '55.3376195', 432, 0, 1, 0, NULL, '2024-08-22 13:06:20', '2024-09-14 13:53:27'),
(225, 260, 1, 1, 5, 'Mimar Architecture & Engineering', 'معمار للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'كل تحديث يسلط الضوء على التزامنا بالمشاريع الرائدة والتقديرات المرموقة في التميز المعماري', '\"Every Update Showcases Our Commitment to Groundbreaking Projects & Prestigious Recognitions in Architectural Excellence\"', 'Horizon Towers - شارع الاتحاد - Al Rashidiya 1 - عجمان - الإمارات العربية المتحدة', '25.3943883', '55.4546228', 192, 0, 1, 0, NULL, '2024-08-22 13:33:56', '2024-09-14 11:34:32'),
(226, 261, 1, 1, 1, 'Design Center Architects and Engineers Consultants', 'مركز التصميم', 'Samar', 'Admin', NULL, 'نحن فخورون بتقديم أنفسنا كواحدة من الشركات الرائدة في الاستشارات المعمارية والهندسية العاملة في دبي وأبو ظبي والشارقة. يقع مكتبنا الرئيسي في دبي وفرعنا في أبو ظبي والشارقة. تم تأسيس مركز التصميم في عام 1998 من قبل شركائه الرئيسيين المهندس مروان عبد الله الجزيري والمهندس محمود ديب علاش. نحن فخورون ولكن متواضعون أن نذكر أنه في هذه الفترة القصيرة من الزمن أصبحنا معروفين مهنيًا كشركة ذات سمعة طيبة بجودة خدماتنا.', 'We are proud to introduce ourselves as one of the leading Architectural and Engineering Consultants operating in Dubai, Abu Dhabi and Sharjah. Our head Office is located in Dubai and a branch office in Abu Dhabi and Sharjah. Design Center was established in the year 1998 by its senior partners Engr.Marwan Abdulla Al Jaziri and Engr. Mahmoud Deeb Alash. We are proud but humble to state that in this short span of time we are professionally identified as a reputed firm with our quality of service.', 'Design Center Architects & Engineers Consultants - دبي - الإمارات العربية المتحدة', '25.258749', '55.3365364', 174, 0, 1, 0, NULL, '2024-08-22 13:50:39', '2024-09-14 05:11:57'),
(227, 262, 1, 3, 1, 'ALZAHRAA FOUNDATION CONTRACTING (L.L.C)', 'الزهراء لحفر الاساسات ش.ذ.م.م', 'Samar', 'Admin', NULL, 'شركة الزهراء للمقاولات الأساسية ذ.م.م. واحدة من شركات الركائز الرائدة والأسرع نموًا في الإمارات العربية المتحدة\r\nمنذ إنشائها. نظرًا لخبرتنا الواسعة في هذا المجال ونظرًا لمعايير الجودة الفائقة، يتم تقديم خدماتنا لإرضاء عملائنا.\r\n\r\nتعمل شركة الزهراء للمقاولات الأساسية ذ.م.م. منذ عام 2006 في دبي، الإمارات العربية المتحدة. مع وجود مهندسين أكفاء يعملون بنشاط في مشاريع مختلفة، فقد أعطينا ثقتنا الكاملة والتزمنا بخدمة ما هو الأفضل لكل عميل بتصميم قوي وإرادة لتقديم نتائج مشاريعهم بفعالية. في عام واحد فقط، نجحنا في اكتساب احترام الأصدقاء والشركات الأخرى التي تتعامل مع نفس العمل وتنمو باستمرار. يتم تصميم الركائز بأقصى قدر من التحضير والبحث. يتم تحقيق ذلك بمساعدة الإدارة الأكثر كفاءة والموظفين والعمال المهرة.', 'Al Zahraa Foundation Contracting LLC one of the\r\nleading and fastest growing piling companies in the UAE\r\nsince its inception. Having vast experience in this line and\r\ndue to superfine standard of quality, our services are\r\nrendered to the satisfaction of our clients.\r\nAl Zahraa Foundation Contracting LLC has been\r\noperating since 2006 in Dubai, UAE. With competent\r\nengineers actively working on various projects, we have\r\ngiven our full trust and committed ourselves in serving what\r\nis best for every client with strong determination and will to\r\neffectively deliver the results of their ventures. In just a year,\r\nwe had successfully gained the respect of friends and other\r\ncompanies that deal with the same business and\r\ncontinuously growing. The pile designs are made with\r\nutmost preparation and research. This is achieved with the\r\nhelp of the most efficient management, staff and skilled\r\nworkers.', 'Al Zahraa Foundation Contracting LLC DIC Branch - Dubai - United Arab Emirates', '24.8452487', '55.0618035', 468, 0, 1, 0, NULL, '2024-08-23 23:59:14', '2024-09-14 14:05:50'),
(228, 263, 1, 1, 1, 'M M S  Architectural and Engineering Consultans', 'إم إم إس للاستشارات المعمارية والهندسية', 'Samar', 'Admin', NULL, 'بدأت شركة MMS Consultants أعمالها في عام 1975. ويمثل الحرف \"MMS\" في اسمنا الأحرف الأولى من أسماء مؤسسينا: المساح روبرت ميكلسون والمهندس رون ماير ومهندس المناظر الطبيعية لاري شنيتر. وكان النجاح في تلك السنوات الأولى مدفوعًا بولاء مجموعة صغيرة من العملاء وقدرة الشركاء على العمل معًا بشكل جيد كفريق واحد وحقيقة أنهم كانوا مهتمين حقًا بالمشاريع التي أُسندت إليهم. وينعكس هذا الاهتمام في شعار MMS، الذي رسمه لاري شنيتر يدويًا بحب. ونحتفظ بهذا الشعار حتى يومنا هذا كتذكير دائم بمدى ما بذله كل من الشركاء من أنفسهم في مشروعهم الجديد.', 'MMS Consultants opened for business in 1975. The “MMS” in our name represents the initials of our founders: Surveyor Robert Mickelson, Engineer Ron Meyer, and Landscape architect Larry Schnittjer. Success in those early years was fueled by the loyalty of a small group of clients, the partners\' ability to work well together as a team, and the fact that they genuinely cared about the projects they were given. That caring is reflected in the MMS logo, lovingly hand-drawn by Larry Schnittjer. We keep that logo to this day as a constant reminder of how much of themselves each of the partners put into their new venture.', 'MMS Architectural and Engineering Consultants - دبي - الإمارات العربية المتحدة', '25.1857871', '55.2819096', 384, 0, 1, 0, NULL, '2024-08-24 00:16:30', '2024-09-13 21:32:05'),
(229, 264, 1, 3, 3, 'Geo Foundation Group L.L.C', 'مجموعة جيو للاساسات ذ.م.م', 'Samar', 'Admin', NULL, 'Geo Foundation Group L.L.C (GFG) هي شركة هندسية للأساسات تأسست في دبي عام 2006. نحن مقاولون متخصصون في جميع أنواع الأعمال تحت الأرض بما في ذلك الركائز، والأكوام، وتحسين الأرض، والأكوام الصغيرة، والحقن، والترسيخ، والحفر، وإزالة المياه.', 'Geo Foundation Group L.L.C (GFG) is a foundation engineering company established in Dubai in 2006. We are a specialized contractor in all type of underground works including shoring, piling, ground improvement, micro pilings, grouting, anchoring, excavation and dewatering.', '8JGR+9VH - الصجعة - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.3259429', '55.6422307', 855, 0, 1, 1, NULL, '2024-08-24 00:34:50', '2024-09-14 14:05:25'),
(230, 265, 1, 1, 1, 'Omnium International Limited', 'اومنيوم', 'Samar', 'Admin', NULL, 'تفتخر شركة Omnium International بالعمل مع عملاء استثنائيين. لأكثر من 50 عامًا، دعمنا التغيير الإيجابي لمجتمعاتنا، وقدمنا ​​الخبرة في إدارة المشاريع والتجارة والتكاليف لبعض أكثر المشاريع إثارة في العالم.\r\n\r\nإن النصائح الموثوقة المدعومة بخبرة لا مثيل لها من فريق الاستشارات المتميز الحائز على جوائز لدينا تبني شراكات عمل وثيقة تساعد في خلق نجاح اقتصادي دائم لمن حولنا.', 'Omnium International is proud to work with exceptional clients. For over 50 years, we have supported positive change for our communities, delivering project management, commercial and cost expertise on some of the world’s most exciting projects.\r\n\r\nReliable advice backed by unparalleled experience from our award-winning, niche consultancy team builds close working partnerships that help to create lasting economic success for those around us.', 'Omnium International Limited - شارع الشيخ زايد - دبي - الإمارات العربية المتحدة', '25.2118324', '55.27470390000001', 210, 0, 1, 0, NULL, '2024-08-24 01:11:27', '2024-09-13 16:49:46'),
(231, 266, 1, 1, 1, 'Smc consulting engineers', 'شركة اس ام سى للاستشارات الهندسة', 'Samar', 'Admin', NULL, 'تغطي خبرتنا في قطاع الضيافة تصميم المرافق المميزة من فئة الخمس نجوم إلى الفنادق البوتيكية، ونحن نقدم لعملائنا خبرة لا مثيل لها في هذا المجال.', 'Our experience in the hospitality industry covers the design of iconic five-star facilities to boutique hotels, we bring unmatched expertise in this area to our clients.', 'Smc consulting engineers', NULL, NULL, 471, 0, 1, 0, NULL, '2024-08-24 01:44:29', '2024-09-14 13:53:27'),
(232, 267, 1, 1, 3, 'AL NAHDA eng.consulting Engineers', 'النهضة للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'تأسست شركة النهضة للاستشارات الهندسية في عام 1986 كشركة استشارية من الدرجة الأولى بهدف تزويد العملاء بتصميمات مبتكرة وموثوقة وحديثة في مجال التخطيط الحضري والتخطيط الحضري والأبراج.', 'AL NAHDA eng.consulting Engineers was established in 1986 as a first class consultant with the aim of providing clients with innovative, reliable and modern designs in the filed of urban & town planning and towers', 'Sharjah - United Arab Emirates', '25.3561698', '55.427211', 654, 0, 1, 0, NULL, '2024-08-24 01:56:48', '2024-09-14 14:05:40'),
(233, 268, 1, 2, 3, 'Al Wathba Building Contracting Company', 'شركة الوثبة للمقاولات الانشائية', 'Samar', 'Admin', NULL, 'شركة الوثبة للبناء والمقاولات هي مجموعة قابضة تأسست في دولة الإمارات العربية المتحدة عام 1989 وتتخصص في خدمات البناء التجارية والمؤسسية والصناعية والطبية.', 'Al Wathba Building & Contracting Company is a holding group established in the United Arab Emirates in 1989 specialize in commercial, institutional, industrial, and medical construction services.', 'شركة الوثبة لمقاولات البناء Alwathba Building Cont.Co - الشارقة - الإمارات العربية المتحدة', '25.3296715', '55.39127999999999', 774, 0, 1, 0, NULL, '2024-08-24 02:19:18', '2024-09-14 14:05:46'),
(234, 269, 1, 1, 1, 'GENERAL CONSTRUCTION C0. LLC', 'الشركة العامة للانشاءات', 'Samar', 'Admin', NULL, 'بفضل خبرتنا الممتدة لأكثر من 25 عامًا في مختلف القطاعات، تقدم شركة General Construction Co. LLC خدمة لا مثيل لها لعملائنا الكرام. وخلال رحلتنا المكثفة، قمنا بصقل مهاراتنا، وإتقان اتجاهات الصناعة، وتعزيز العلاقات الدائمة، وكل هذا يساهم في التزامنا الثابت بالتميز في كل مشروع نتعهد به.', 'With over 25 years of experience spanning diverse sectors, General Construction Co. LLC delivers unparalleled service to our esteemed clients. Throughout our extensive journey, we have honed our skills, mastered industry trends, and fostered lasting relationships, all of which contribute to our unwavering commitment to excellence in every project we undertake.', 'Al Mezan Tower - Muhaisnah 4 - Dubai - دبي - UAE', '25.2873546', '55.4008017', 744, 0, 1, 0, NULL, '2024-08-25 12:40:05', '2024-09-14 14:05:28'),
(235, 270, 1, 2, 1, 'Al Shafar Electrical & Mechanical Engineering Co. (LLC)', 'شركة الشعفار للهندسة الكهربائية والميكانيكية ذ.م.م', 'Samar', 'Admin', NULL, 'تعمل شركة الشعفار للهندسة الكهربائية والميكانيكية (ذ.م.م )فى – اعمال التمديدات الكهربائيه – اعمال التمديدات و التركيبات الصحية', 'Al Shafar Electrical and Mechanical Engineering Company (LLC) works in - Electrical extension works - Sanitary extensions and installations works', 'AL SHAFAR ELECTROMECHANICAL ENGINEERING ( L.L.C) - دبي - الإمارات العربية المتحدة', '25.2364594', '55.2890612', 774, 0, 1, 0, NULL, '2024-08-25 13:02:22', '2024-09-14 14:05:28'),
(236, 271, 1, 2, 3, 'ALthuriah construction', 'الثريا لمقاولات البناء', 'Samar', 'Admin', NULL, NULL, NULL, 'Al Thuriah, Sahara Tower 1 - شارع النهدة - إمارة الشارقةّ - الإمارات العربية المتحدة', '25.29840039999999', '55.36620420000001', 822, 0, 1, 0, NULL, '2024-08-25 13:34:11', '2024-09-14 14:05:28'),
(237, 272, 1, 3, 1, 'Meraki facade & glazing systems llc', 'شركة ميراكي لأنظمة الواجهات والتزجيج', 'Samar', 'Admin', NULL, 'شركة ميراكي للتطوير العقاري هي شركة تطوير عقاري مملوكة للقطاع الخاص، وهي جزء من مجموعة ميراكي. وهي تجمع مجموعة من الأفراد الموهوبين للغاية الذين يتمتعون بخبرة ومعرفة لسنوات في مجال تطوير العقارات لبناء مجتمعات مستدامة ومصممة بذكاء وحديثة، وهي في طليعة الفخامة الوظيفية.', 'Meraki Developers is a backward integrated privately held real estate developer and is part of the Meraki Group. It brings together a group of highly talented individuals with years of domain expertise and knowledge in real estate development to build state-of-the-art, astutely designed, sustainable communities which are at the cutting edge of functional luxury.', 'Sobha Sapphire - Al Khaleej Al Tejari 2 Street - دبي - الإمارات العربية المتحدة', '25.1781685', '55.27467799999999', 0, 0, 0, 0, NULL, '2024-08-25 14:10:57', '2024-08-25 14:13:16');
