(238, 273, 1, 2, 1, 'Meraki Integrated Contracting LLC', 'شركة ميراكي للمقاولات المتكاملة ذ.م.م', 'Samar', 'Admin', NULL, 'شركة ميراكي للتطوير العقاري هي شركة تطوير عقاري مملوكة للقطاع الخاص، وهي جزء من مجموعة ميراكي. وهي تجمع مجموعة من الأفراد الموهوبين للغاية الذين يتمتعون بخبرة ومعرفة لسنوات في مجال تطوير العقارات لبناء مجتمعات مستدامة ومصممة بذكاء وحديثة، وهي في طليعة الفخامة الوظيفية.', 'Meraki Developers is a backward integrated privately held real estate developer and is part of the Meraki Group. It brings together a group of highly talented individuals with years of domain expertise and knowledge in real estate development to build state-of-the-art, astutely designed, sustainable communities which are at the cutting edge of functional luxury.', 'Sobha Sapphire - Al Khaleej Al Tejari 2 Street - دبي - الإمارات العربية المتحدة', '25.1781685', '55.27467799999999', 0, 0, 0, 0, NULL, '2024-08-25 14:21:13', '2024-08-25 14:27:26'),
(239, 274, 1, 1, 1, 'WME Engineering Consultants', 'شركة دبليو إم إي للاستشارات الهندسية', 'Samar', 'Admin', NULL, 'WME هي شركة استشارية مستقلة متعددة التخصصات تقدم خدمات هندسية للبيئة المبنية. يقع مقرها في الشرق الأوسط، ولها مكاتب في بنغالور ولندن، وتقدم حلولاً هندسية في جميع أنحاء العالم.', 'WME is an independent multi-disciplinary consultancy providing ENGINEERING SERVICES for the built environment. They are based in the Middle East, with offices in Bangalore and London, delivering engineering solutions around the globe.', 'Emarat Atrium Building - Sheikh Zayed Road - دبي - الإمارات العربية المتحدة', '25.1895137', '55.25633609999999', 363, 0, 1, 0, NULL, '2024-08-25 14:36:28', '2024-09-14 14:05:28'),
(240, 275, 1, 7, 1, 'U+A Architecture, Interior Design, Urban Planning', 'U+A الهندسة المعمارية، التصميم الداخلي، التخطيط الحضري', 'Samar', 'Admin', NULL, 'تعد شركة U+A، وهي جزء من مجموعة Egis، شركة دولية للهندسة المعمارية والتصميم تعتمد نهجًا متعدد التخصصات. وتشمل خدماتنا الهندسة المعمارية والتصميم الداخلي وهندسة المناظر الطبيعية والتخطيط الحضري والتخطيط الرئيسي. نسعى جاهدين للحفاظ على معايير عالية تتماشى مع ممارسات الصناعة مع تعزيز الإبداع والابتكار.', 'U+A, part of the Egis Group, is an international architecture and design firm with a multidisciplinary approach. Our services encompass architecture, interior design, landscape architecture, urban planning, and master planning. We strive to uphold high standards in line with industry practices while fostering creativity and innovation.', 'Emaar Business Park - شارع الشيخ زايد - Dubai - Dubai - الإمارات العربية المتحدة', '25.0959059', '55.1673686', 0, 0, 0, 0, NULL, '2024-08-25 15:03:01', '2024-08-25 15:03:48'),
(241, 276, 1, 2, 1, 'Gulf Modern Contracting', 'جلف مودرن للمقاولات ش.م.م', 'Samar', 'Admin', NULL, 'نحن شركة إنشاءات عامة سريعة النمو في دولة الإمارات العربية المتحدة مع ترخيص غير محدود.', 'We are a fast-growing general construction company in UAE with unlimited license.', 'Dusseldorf Business Point - Al Barsha Road - Al Barsha 1 - Dubai - دبي - UAE', '25.1145669', '55.20505499999999', 783, 0, 1, 0, NULL, '2024-08-25 15:09:57', '2024-09-14 14:05:28'),
(242, 277, 1, 4, 1, 'AYHACO Gypsum products manufacturing', 'AYHACO Gypsum products manufacturing', 'AYHACO Gypsum products manufacturing', 'AYHACO Gypsum products manufacturing', NULL, 'About Us\r\nWho We Are?\r\nWelcome to AYHACO – where building dreams has been a passion since 1973!\r\nWe\'re your trusted partners in construction, we specialize in delivering a comprehensive range of top-quality building materials, catering to both projects and wholesale needs. Our commitment to excellence and innovation has made us a go-to supplier, crafting reliable solutions for your construction needs.', 'About Us\r\nWho We Are?\r\nWelcome to AYHACO – where building dreams has been a passion since 1973!\r\nWe\'re your trusted partners in construction, we specialize in delivering a comprehensive range of top-quality building materials, catering to both projects and wholesale needs. Our commitment to excellence and innovation has made us a go-to supplier, crafting reliable solutions for your construction needs.', 'Ayhaco Gypsum Products, Al Quoz) - Dubai - United Arab Emirates', '25.1498422', '55.2372488', 762, 1, 1, 0, NULL, '2024-08-30 19:01:57', '2024-09-14 14:05:28'),
