(7, 1, 1, NULL, 'QS/CIVIL/ (5-8) YRS', 'QS/CIVIL/ (5-8) YRS', '➢ Preparation up to date report on progress of assigned project.\r\n\r\n➢ Liaising with client representatives/ Consultant and coordinate with the construction Site team and\r\n subcontractors for all commercial requirements.\r\n\r\n➢ Prepare Monthly Payment application for Consultant verification.\r\n\r\n\r\n➢ Prepare Payment Certificate for Subcontractors.\r\n\r\n➢ Preparing variation Notification, submission related to changes in Contract with all supporting documents.\r\n\r\n➢ Take-off Quantities and Evaluate of actual work done and Preparing Monthly Payment Certificate for Internal / External Sub-contractors / Nominated Suppliers.\r\n\r\nQuantity Surveyor Requirements:\r\n\r\n➢ Bachelor\'s degree in quantity surveying, Civil engineering or Quantity Surveying Diploma or similar.\r\n\r\n➢ Strong Knowledge of FIDIC\r\n\r\n➢ Knowledge in Plan-Swift Software is preferable. \r\n\r\n➢ Excellent negotiating and interpersonal skills.', '➢ Preparation up to date report on progress of assigned project.\r\n\r\n➢ Liaising with client representatives/ Consultant and coordinate with the construction Site team and\r\n subcontractors for all commercial requirements.\r\n\r\n➢ Prepare Monthly Payment application for Consultant verification.\r\n\r\n\r\n➢ Prepare Payment Certificate for Subcontractors.\r\n\r\n➢ Preparing variation Notification, submission related to changes in Contract with all supporting documents.\r\n\r\n➢ Take-off Quantities and Evaluate of actual work done and Preparing Monthly Payment Certificate for Internal / External Sub-contractors / Nominated Suppliers.\r\n\r\nQuantity Surveyor Requirements:\r\n\r\n➢ Bachelor\'s degree in quantity surveying, Civil engineering or Quantity Surveying Diploma or similar.\r\n\r\n➢ Strong Knowledge of FIDIC\r\n\r\n➢ Knowledge in Plan-Swift Software is preferable. \r\n\r\n➢ Excellent negotiating and interpersonal skills.', 'career@aaai.ae', NULL, NULL, NULL, 0, '2023-09-26 02:16:07', '2023-05-25 03:24:48', '2023-09-26 02:16:07'),
