(3, 'Standard one year', 'الاساسية سنة', 0, 1500, '<p>Add your company and business.</p>\r\n<p>Company page with full control.</p>\r\n<p>&nbsp;Add social and WhatsApp accounts.</p>\r\n<p>Post your products in the sales section.</p>\r\n<p>Access to the projects section and its data.</p>\r\n<p>Access to the distinctive map of the companies\' business.</p>\r\n<p>Monthly advertisement for your company and business on the home page.</p>\r\n<p>Unlimited videos on YouTube channel.</p>', '<p style=\"text-align: right;\">اضافة شركتك واعمالك</p>\r\n<p style=\"text-align: right;\">&nbsp;صحفة خاصة بالشركة بالتحكم الكامل&nbsp;</p>\r\n<p style=\"text-align: right;\">&nbsp;اضافة حسابات التواصل و الواتساب</p>\r\n<p style=\"text-align: right;\">نشر منتجاتك فى قسم المبيعات</p>\r\n<p style=\"text-align: right;\">الوصول لقسم المشاريع وبياناتة</p>\r\n<p style=\"text-align: right;\">الوصول للخريطة المميزة الخاصة باعمال الشركات</p>\r\n<p style=\"text-align: right;\">&nbsp; اعلان شهري&nbsp; لشركتك واعمالك&nbsp;<span style=\"font-size: 0.875rem;\">على الصفحة الرئيسية</span></p>\r\n<p style=\"text-align: right;\">نشر فديوهات لا محدودة&nbsp;<span style=\"font-size: 0.875rem;\">على قناة اليوتيوب</span></p>\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n<p>&nbsp;</p>', 1, '2023-04-07 14:54:01', '2023-04-09 03:02:13', NULL);
